INSERT INTO `t_news` VALUES ('83', '19', 'ビールが変わる 果物…ハーブ… 新しいビール次々発売', '法律によるビールの定義が今月から変わり、果物やハーブなどを使った新しいビールが相次いで発売されます。', '2018-04-02 04:37:39', 'http://www3.nhk.or.jp/news/html/20180402/k10011387631000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('84', '19', '在宅医療 24時間対応へ連携する医師に報酬増額', '在宅医療を担う医師がまだ少ない地域では、医療機関どうしが連携しグループで訪問診療を行っていこうとする取り組みが始まっています。', '2018-04-02 04:45:26', 'http://www3.nhk.or.jp/news/html/20180402/k10011387781000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('85', '19', '使用済み紙おむつ 保育園から区が回収 東京 豊島区', '子どもの健康状態を確認してもらうため保育園から家庭に持ち帰っていた使用済みの紙おむつを、自治体が回収する取り組みが東京・豊島区で始まっています。', '2018-04-02 05:24:28', 'http://www3.nhk.or.jp/news/html/20180402/k10011387861000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('86', '19', '江ノ電が4か国語アプリ配信 観光情報を紹介 神奈川', '神奈川県の鎌倉市と藤沢市を走る江ノ島電鉄が４か国語で観光情報を紹介するアプリの配信を始めました。', '2018-04-02 05:28:07', 'http://www3.nhk.or.jp/news/html/20180402/k10011387871000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('87', '19', 'カンボジア出身の技術者採用 人手不足の建設会社', '建設業界の人手不足が深刻化する中、佐賀市の建設会社ではカンボジア出身の技術者を初めて採用し、２日、入社式で辞令が交付されました。', '2018-04-02 12:33:27', 'http://www3.nhk.or.jp/news/html/20180402/k10011388071000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('88', '19', '豪雨被害の朝倉市役所で入庁式 福岡', '去年７月の九州北部豪雨で大きな被害を受けた福岡県朝倉市の市役所で入庁式が行われ、復興に向けて去年より５人多い２１人の新人職員が辞令を受けました。', '2018-04-02 14:24:56', 'http://www3.nhk.or.jp/news/html/20180402/k10011388161000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('89', '19', '富山湾のシロエビ漁 ことしの初水揚げ', '富山湾に春の訪れを告げるシロエビ漁が始まり、富山県射水市の港で、２日朝、取れたばかりのシロエビが水揚げされました。', '2018-04-02 14:25:27', 'http://www3.nhk.or.jp/news/html/20180402/k10011388151000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('90', '19', '”秋田犬の目線で”パノラマ画像がネットで人気 秋田 大館', '「秋田犬の目線で観光スポットの風景を楽しみませんか？」。秋田犬のふるさととして知られる秋田県大館市は、市内にある観光地を秋田犬の目線で撮影した画像をインターネットの地図に掲載して紹介し、人気を集めています。', '2018-04-02 14:35:31', 'http://www3.nhk.or.jp/news/html/20180402/k10011388201000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('91', '19', '世界自閉症啓発デー 姫路城が青く浮かび上がる', '４月２日は国連が定めた世界自閉症啓発デーです。兵庫県姫路市の国宝・姫路城は、自閉症への理解を呼びかけようと、シンボルカラーのブルーにライトアップされました。', '2018-04-02 19:55:20', 'http://www3.nhk.or.jp/news/html/20180402/k10011388571000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('92', '19', '頭部に矢のようなもの刺さったユリカモメ 宮城 石巻', '宮城県石巻市で、頭の部分に矢のようなものが刺さったユリカモメが見つかり、県が保護して手当てできないか検討しています。', '2018-04-02 20:28:07', 'http://www3.nhk.or.jp/news/html/20180402/k10011388081000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('93', '19', '「伊藤忠」輸入の大麦から基準超の殺菌剤 農水省が処分へ', '「伊藤忠商事」が輸入した大麦の一部から、基準を超える殺菌剤が検出されたとして、農林水産省は米と麦の輸入業務で伊藤忠を指名停止処分とする方針です。この大麦の半数近くはすでに消費されたと見られていますが、農林水産省は「健康に悪影響を与えるおそれはない」としています。', '2018-04-03 13:37:24', 'http://www3.nhk.or.jp/news/html/20180403/k10011389221000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('94', '19', '阿波おどりのＰＲポスター ことしは自主制作', '徳島市の阿波おどりをめぐり、去年までＰＲポスターを手がけてきたグラフィックデザイナーとコピーライターが、ことしはポスターを自主制作することを決めました。', '2018-04-03 13:58:32', 'http://www3.nhk.or.jp/news/html/20180403/k10011389241000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('95', '19', '「鹿を怒らせないで」英語と中国語で看板 外国人けが急増 奈良', '奈良公園に生息する国の天然記念物、「奈良のシカ」に好物の鹿せんべいを与える際、じらすなどしてかまれる外国人観光客などが急増していることから、奈良県は英語と中国語で正しい与え方を説明する看板の設置を始めました。', '2018-04-03 14:15:48', 'http://www3.nhk.or.jp/news/html/20180403/k10011389151000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('96', '19', '地震被害の熊本城天守閣 真新しい屋根瓦が姿現す', 'おととしの熊本地震で大きな被害を受けた熊本城の天守閣で、屋根瓦のふき替えがほぼ終わり、３日、白い仮設の屋根が撤去され、真新しい屋根瓦が姿を見せました。', '2018-04-03 14:17:05', 'http://www3.nhk.or.jp/news/html/20180403/k10011389291000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('97', '19', 'ビール値上げ 「安さが売り」値段据え置く居酒屋も', '先月から今月にかけて大手４社が瓶ビールなどの出荷価格を引き上げましたが、各地の居酒屋では、お客の減少を防ぐため値段を据え置く店もあり、対応に苦慮しています。', '2018-04-03 14:34:26', 'http://www3.nhk.or.jp/news/html/20180403/k10011389321000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('98', '19', '河原で祝う月遅れのひな祭り「オヒナゲエ」埼玉 小鹿野町', '子どもたちが河原にひな人形を飾っておかゆを食べ、月遅れのひな祭りを祝う伝統の行事が埼玉県小鹿野町で行われました。', '2018-04-03 15:15:47', 'http://www3.nhk.or.jp/news/html/20180403/k10011389351000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('99', '19', '雪どけ進み各地で道路の清掃作業 札幌', '春の訪れとともに札幌市内では雪どけが進み、冬の間、道路にたまった滑り止めの砂などを取り除く清掃作業が各地で行われています。', '2018-04-03 20:20:10', 'http://www3.nhk.or.jp/news/html/20180403/k10011389791000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('100', '19', 'イモをつかんで復興に弾みを 一風変わったクレーンゲーム登場', '熊本地震で被害を受けた熊本県西原村の農産物直売所で、復興に向けた弾みにしようと、特産のサツマイモを景品にした一風変わったクレーンゲームが登場しました。', '2018-04-03 20:26:50', 'http://www3.nhk.or.jp/news/html/20180403/k10011389811000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('101', '19', '「春バテ」に注意！ 新生活のストレスや寒暖の差が原因か', '春に「だるさ」など心身の不調を感じる人がおよそ６割に上ることが医師などでつくる団体の調査でわかりました。調査にかかわった医師は、新生活のストレスや大きな寒暖の差によるこの時期特有の「春バテ」の症状と指摘したうえで、入浴で体を温めるなどの予防策を勧めています。', '2018-04-03 20:39:46', 'http://www3.nhk.or.jp/news/html/20180403/k10011389831000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('102', '19', '「希望を持って」”ひふみん”教授が女子大入学式で激励', '仙台市にある仙台白百合女子大学の入学式に、客員教授を務める元プロ棋士の加藤一二三九段が登場し、「希望を持って生きることが大切だ」と新入生を励ましました。', '2018-04-03 21:16:15', 'http://www3.nhk.or.jp/news/html/20180403/k10011389891000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('103', '19', '大蛇を退治して厄よけ「蛇の目神事」 石川', '石川県羽咋市の気多大社で、大蛇の目に見立てた的に矢を放ち、厄よけを行う伝統行事「蛇の目神事」が行われました。', '2018-04-03 21:27:04', 'http://www3.nhk.or.jp/news/html/20180403/k10011389911000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('104', '19', '“インスタ映え” 演習林に訪問者急増 大学は対応に苦慮 福岡', '福岡県の九州大学農学部の演習林の中にある幻想的な水辺の光景がＳＮＳを通じて話題になり、立ち入りが規制されているエリアに入って写真を撮る人が相次いでいることから、大学が対応に苦慮しています。', '2018-04-04 11:31:45', 'http://www3.nhk.or.jp/news/html/20180404/k10011390291000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('105', '19', '「ひょうたん島」「まつたけの里」三陸鉄道の駅 愛称決まる', '東日本大震災で大きな被害を受けた岩手県の三陸鉄道は、ＪＲから移管後の来年３月２３日から運行する路線の１３の駅と新たに設置する駅の愛称を決めました。', '2018-04-04 14:51:30', 'http://www3.nhk.or.jp/news/html/20180404/k10011390521000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('106', '19', '羽生選手の記念Ｔシャツ 受け付け開始 祝賀パレードの費用に', 'フィギュアスケート男子シングルでオリンピック２連覇を達成した羽生結弦選手の仙台市での祝賀パレードに向け、記念Ｔシャツが販売されることになり、インターネットなどで受け付けが始まりました。', '2018-04-04 15:21:17', 'http://www3.nhk.or.jp/news/html/20180404/k10011390541000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('107', '19', '「“箱入り娘”はオスでした」 高知の水族館のカピバラ', '高知市の水族館が去年の夏にメスとして譲り受け育ててきたカピバラが、最近になってオスであることがわかりました。水族館は「“箱入り娘”として育ててきたので驚いたが、変わらず愛情を注いでいきたい」と話しています。', '2018-04-04 16:02:16', 'http://www3.nhk.or.jp/news/html/20180404/k10011390621000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('108', '19', 'ニッポンレンタカー 11月から全車両を禁煙に', '公共施設や飲食店などさまざまな場所に広がる全面禁煙の動きがレンタカー業界にも訪れます。大手の「ニッポンレンタカー」では、ことし１１月から一般向けに貸し出すすべての車を禁煙とすることになりました。', '2018-04-05 04:27:19', 'http://www3.nhk.or.jp/news/html/20180405/k10011391111000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('109', '19', '路面電車の停留場 観光名所を反映 長崎', '長崎市内を走る路面電車の停留場の名称がことし８月から３５年ぶりに変更されます。「平和公園」や「中華街」など沿線の施設の名前を反映させて、観光客にわかりやすいものになります。', '2018-04-05 12:00:39', 'http://www3.nhk.or.jp/news/html/20180405/k10011391631000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('110', '19', '薬局で認知症早期発見！ 福島で「認知症対応薬局」の取り組み', '認知症について専門知識を持った薬剤師がいる薬局を「認知症対応薬局」として認定し、症状の出始めた高齢者に医療機関への受診を勧める取り組みが福島県内で始まりました。', '2018-04-05 14:46:44', 'http://www3.nhk.or.jp/news/html/20180405/k10011391771000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('111', '19', '緑色の桜 見頃迎える 宮崎 串間', '宮崎県串間市にある寺の境内で、淡い緑色の桜が見頃となり、訪れた人を楽しませています。', '2018-04-05 15:26:42', 'http://www3.nhk.or.jp/news/html/20180405/k10011391831000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('112', '19', '暮らし向き「ゆとりなくなってきた」増加', '個人の暮らし向きについて「ゆとりがなくなってきた」と感じる人が増えていることが日銀の調査でわかりました。', '2018-04-05 16:18:02', 'http://www3.nhk.or.jp/news/html/20180405/k10011391911000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('113', '19', '幕末の大砲を再現 祝砲の試し撃ち 佐賀', 'ことしの明治維新１５０年に合わせ、佐賀市の佐賀城本丸歴史館では、幕末の佐賀藩が作った大砲を再現したカノン砲による祝砲の試し撃ちが行われました。', '2018-04-05 20:52:27', 'http://www3.nhk.or.jp/news/html/20180405/k10011392281000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('114', '19', '阿波おどり 徳島市が事務局の実行委員会で開催へ', '日本を代表する夏祭り、阿波おどりの運営組織が巨額の累積赤字を抱えている問題で、地元の徳島市は、ことしの祭りでは、これまで主催してきた観光協会と徳島新聞社を運営から外し、市を事務局とする実行委員会の下で開催する方針を決めました。', '2018-04-05 20:55:53', 'http://www3.nhk.or.jp/news/html/20180405/k10011392231000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('115', '19', '国宝の松江城天守 内部が空っぽの状態を公開', '国宝の松江城天守は、展示品を取り替えるため、内部が空っぽの状態となっていて、なかなか見ることのできないおよそ４００年前の姿が公開されています。', '2018-04-05 21:21:12', 'http://www3.nhk.or.jp/news/html/20180405/k10011392291000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('116', '19', '新燃岳の噴煙 8000ｍまで上昇か 一連の活動で最高', '鹿児島県と宮崎県の県境にある霧島連山の新燃岳で、５日午前４時前に起きた噴火について、気象庁が気象衛星のデータを詳しく分析した結果、噴煙が一連の噴火活動で最も高い８０００メートルまで上がったと推定されることがわかりました。', '2018-04-05 22:54:21', 'http://www3.nhk.or.jp/news/html/20180405/k10011392341000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('117', '19', '緊急地震速報 認知度９割超も速報利用に課題', '運用開始から１０年が経過した緊急地震速報について、「知っている」と答えた人は９割を超えた一方、「とるべき行動をあらかじめ決めている」人は、２割にとどまったことが気象庁のアンケート調査でわかりました。気象庁は「速報を効果的に利用できるよう、事前にどう行動するか決めておいてほしい」と話しています。', '2018-04-06 04:25:03', 'http://www3.nhk.or.jp/news/html/20180406/k10011392511000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('118', '19', '老いても脳は生まれ変わる 米コロンビア大の研究', '人間の思考などをつかさどる脳の神経細胞は、大人になると増えないとされてきましたが、年齢を重ねても新しい細胞が生まれていることをアメリカの研究グループが突き止め、認知症などの治療法の開発にもつながる研究成果として注目されそうです。', '2018-04-06 06:44:37', 'http://www3.nhk.or.jp/news/html/20180406/k10011392641000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('119', '19', '２月の給与 ７か月連続増加 物価上昇で実質賃金は減少', 'ことし２月の給与総額は平均で２６万円余りと、７か月連続で前の年の同じ月を上回りました。一方、物価の変動分を反映した実質賃金は０．５％減少しました。', '2018-04-06 09:51:19', 'http://www3.nhk.or.jp/news/html/20180406/k10011392751000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('120', '19', '新小学１年生の将来の夢 ユーチューバーの人気上がる', '子どものころの夢、覚えていますか？この春、小学校に入学する新１年生たちに将来の夢を聞いたアンケート。男の子は動画サイトに動画を投稿する「ユーチューバー」の人気が上がっています。', '2018-04-06 10:59:57', 'http://www3.nhk.or.jp/news/html/20180406/k10011392851000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('121', '19', '２月の消費支出0.9％減 野菜の高値も響いたか', 'この冬、続いた野菜の高値が、家計の支出にも響いたようです。ことし２月に家庭が消費に使ったお金は、値上がりの影響を除くと去年と比べて０．９％減りました。', '2018-04-06 11:49:44', 'http://www3.nhk.or.jp/news/html/20180406/k10011392741000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('122', '19', '壊された千葉のビリケンさん 代わりに大阪から金色の像', '千葉県流山市で幸福を呼ぶ神様として親しまれてきた「ビリケンさん」の像が壊されたことを受けて、大阪 通天閣でビリケンさんのキャラクター商品などを手がけている団体から金色の「ビリケン像」が届けられることになりました。', '2018-04-06 12:14:23', 'http://www3.nhk.or.jp/news/html/20180406/k10011392991000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('123', '19', '東京五輪の2020年 ３つの祝日が移動する見通し', '東京オリンピックによる交通機関の混雑緩和のため、国会議員や海運業者らでつくる団体は、２０２０年に限り７月第３月曜日の「海の日」を開会式前日の７月２３日に移すことを認める決議を行いました。オリンピック期間に合わせ「体育の日」と「山の日」も移す方向で調整が進んでいて、３つの祝日が移動する見通しとなりました。', '2018-04-06 12:58:02', 'http://www3.nhk.or.jp/news/html/20180406/k10011393091000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('124', '19', '琉球国王の子孫が先祖供養の “清明祭” を復活 40年ぶり', '那覇市にある琉球王国時代の国王の墓で６日、国王の子孫、尚家（しょうけ）の当主が先祖を供養する伝統行事シーミー（清明祭）をおよそ４０年ぶりに復活させ、古式にのっとって行われました。', '2018-04-06 14:32:37', 'http://www3.nhk.or.jp/news/html/20180406/k10011393041000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('125', '19', '“30ｋｍ”助け合いながら歩くユニークな新入社員研修 新潟', '新潟市の企業で、この春入社したばかりの新入社員が先輩社員と一緒に助け合いながら３０キロを歩き切るユニークな研修が行われました。', '2018-04-06 14:43:37', 'http://www3.nhk.or.jp/news/html/20180406/k10011393191000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('126', '19', '山梨 富士吉田で桜満開 富士山とのコントラスト楽しむ', '富士山のふもとにある山梨県富士吉田市の公園で６日、桜が満開となり、訪れた人たちが桜の花と富士山のコントラストを楽しんでいます。', '2018-04-06 15:20:26', 'http://www3.nhk.or.jp/news/html/20180406/k10011393211000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('127', '19', '７年ぶり 学びやに子どもたちが帰って来た 福島', '原発事故でふるさとを追われて７年。避難指示が徐々に解除されつつある福島の地元では、帰ってきた子どもたちが新しい学びやで春を迎えています。', '2018-04-06 18:06:10', 'http://www3.nhk.or.jp/news/html/20180406/k10011393261000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('128', '19', '地震で大きな被害の熊本城 新たなしゃちほこ設置始まる', '２年前の熊本地震で大きな被害を受けた熊本城の天守閣で、新しく作られたしゃちほこを設置する作業が始まりました。', '2018-04-06 18:37:39', 'http://www3.nhk.or.jp/news/html/20180406/k10011393601000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('129', '19', '「あまちゃん」の三陸鉄道に新入社員', 'ＮＨＫの連続テレビ小説「あまちゃん」の舞台として知られる岩手県の三陸鉄道に、初々しい新入社員が入社しました。', '2018-04-07 09:24:55', 'http://www3.nhk.or.jp/news/html/20180407/k10011393711000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('130', '19', '赤ちゃん羊に乳飲ませる体験会 群馬 渋川', '群馬県渋川市の牧場では、この春生まれた羊の赤ちゃんに哺乳瓶で乳を飲ませる体験会が開かれています。', '2018-04-07 12:16:15', 'http://www3.nhk.or.jp/news/html/20180407/k10011394181000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('131', '19', 'オスプレイ配備予定の米軍横田基地 住民らと交流の催し', 'アメリカ軍の輸送機オスプレイが正式に配備される見通しとなっている東京のアメリカ軍横田基地で、地元の住民らと交流する催しが開かれました。', '2018-04-07 16:22:11', 'http://www3.nhk.or.jp/news/html/20180407/k10011394271000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('132', '19', '福島 富岡町 夜の森地区の桜並木で歩行者天国', '原発事故の影響が続く福島県富岡町の桜の名所、夜の森地区の桜並木で歩行者天国が行われ、避難先から駆けつけた人などが散りゆく花を惜しむように眺めていました。', '2018-04-07 16:38:43', 'http://www3.nhk.or.jp/news/html/20180407/k10011394281000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('133', '19', '震災から７年 閖上地区に小中学校の校舎完成 宮城 名取', '東日本大震災で大きな被害を受けた宮城県名取市の閖上地区に、小中一貫の学校が７年たってようやく完成し、７日、開校式が行われました。', '2018-04-07 17:43:05', 'http://www3.nhk.or.jp/news/html/20180407/k10011394361000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('134', '19', '1500人が武者行列 信玄公祭りで甲州軍団出陣', '戦国武将、武田信玄をしのんで甲府市で開かれている祭りの最大の見どころ、「甲州軍団出陣」が行われ、およそ１５００人の武者行列がまちを練り歩きました。', '2018-04-07 18:59:41', 'http://www3.nhk.or.jp/news/html/20180407/k10011394401000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('135', '19', '戦国時代から続く伝統の槍術 女性が初めて審査に合格', '戦国時代から続く奈良発祥のやりの流派「宝蔵院流槍術」で、流派の歴史で初めて女性が「初級」の審査に合格しました。', '2018-04-07 19:56:44', 'http://www3.nhk.or.jp/news/html/20180407/k10011394481000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('136', '19', '木曽義仲ゆかりの地でやぶさめ披露 埼玉 嵐山町', '平安時代の武将、木曽義仲の生誕の地と言われる埼玉県嵐山町で、走る馬の上から矢を放って的を射るやぶさめが披露されました。', '2018-04-07 20:26:59', 'http://www3.nhk.or.jp/news/html/20180407/k10011394441000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('137', '19', '妊娠可能性あればふだんから葉酸摂取を', 'ビタミンの一種の「葉酸」を摂取することでリスクを下げることができるとされる赤ちゃんの病気が増加する傾向を示していて、産婦人科の医師の団体は、妊娠する可能性がある女性はふだんから「葉酸」を摂取するよう呼びかけています。', '2018-04-08 05:21:53', 'http://www3.nhk.or.jp/news/html/20180408/k10011394561000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('138', '20', '「悪質商法」高齢者の被害 ４割余が泣き寝入り', '東京都が高齢者を対象に行った「悪質商法」に関する調査で、被害にあった人の４０％余りが泣き寝入りしていたことがわかり、都は、不審に感じたら消費生活センターなどに相談するよう呼びかけています。', '2018-04-08 06:12:03', 'http://www3.nhk.or.jp/news/html/20180408/k10011394511000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('139', '20', '妊娠可能性あればふだんから葉酸摂取を', 'ビタミンの一種の「葉酸」を摂取することでリスクを下げることができるとされる赤ちゃんの病気が増加する傾向を示していて、産婦人科の医師の団体は、妊娠する可能性がある女性はふだんから「葉酸」を摂取するよう呼びかけています。', '2018-04-08 05:21:53', 'http://www3.nhk.or.jp/news/html/20180408/k10011394561000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('140', '20', '「枕たたき」でストレス発散 米ニューヨークでイベント', 'インターネット上の呼びかけに応じた人たちが、持参した枕で体をたたき合い日頃のストレスを発散するイベントが世界各地で行われました。', '2018-04-08 09:53:12', 'http://www3.nhk.or.jp/news/html/20180408/k10011394791000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('141', '20', '日中韓首脳会議来月で調整 中国首相初訪日へ', '３年前に開催されて以来、途絶えている日本、中国、韓国の３か国の首脳会議について、来月９日に開催する方向で最終的な調整が進められていることがわかり、これにあわせて中国の李克強首相が就任以来初めて日本を訪れ、滞在中、北海道への地方視察も検討されているということです。', '2018-04-08 05:07:15', 'http://www3.nhk.or.jp/news/html/20180408/k10011394711000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('142', '20', 'ドイツでレストランに車突っ込む 2人死亡20人重軽傷', 'ドイツ西部の町で７日、客でにぎわうレストランの屋外の席にワゴン車が突っ込んで、２人が死亡、およそ２０人が重軽傷を負い、警察は、現場で自殺した運転手の男が故意に車を突入させた疑いもあるとみて調べています。', '2018-04-08 04:41:08', 'http://www3.nhk.or.jp/news/html/20180408/k10011394681000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('143', '20', '鹿児島３人殺害事件 不明の２人は数日前に事件に巻き込まれたか', '鹿児島県日置市の住宅で親族や近所の男女３人が殺害された事件では、逮捕された３８歳の男の祖母と父親も行方がわからなくなっていて、父親は数日前から仕事に来なくなっていました。２人は、この頃、事件に巻き込まれたとみられ、警察は、男が何らかの事情を知っている可能性があるとみて調べています。', '2018-04-08 07:28:16', 'http://www3.nhk.or.jp/news/html/20180408/k10011394651000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('144', '20', '米 トランプタワーで火災 住民１人死亡 消防士４人けが', 'アメリカのトランプ大統領の自宅が入るニューヨーク中心部のトランプタワーで現地時間の７日夜（日本時間８日朝）、火災が発生し、消火活動が行われた結果、火はほぼ消し止められました。消防当局によりますと、この火災で、住民１人が死亡し、消防士４人がけがをしたということです。', '2018-04-08 09:44:31', 'http://www3.nhk.or.jp/news/html/20180408/k10011394811000.html', 'http://www3.nhk.or.jp/topmenu/1203_head/img/logo.png', null, null);
INSERT INTO `t_news` VALUES ('145', '27', 'Jennifer Lawrence bares all as a Russian agent in Red Sparrow', 'Brian Viner reviews Red Sparrow, Game Night and Opera; The Marriage Of Figaro. He also reveals who his top picks for gongs at this weeks Oscars are.', '2018-03-02 12:58:13', 'http://www.dailymail.co.uk/tvshowbiz/article-5452697/Jennifer-Lawrence-bares-Russian-agent-Red-Sparrow.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/02/01/49B6D02C00000578-0-image-a-100_1519955930929.jpg', null, null);
INSERT INTO `t_news` VALUES ('146', '27', 'You Were Never Really Here is pretentious but never dull ', 'Deeply disturbing films about disturbed people can make compelling cinema, and Scottish writer-director Lynne Ramsay may have done just that.', '2018-03-09 01:22:58', 'http://www.dailymail.co.uk/tvshowbiz/article-5480395/You-Never-Really-pretentious-never-dull.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/09/01/49D228CD00000578-0-image-a-6_1520557828620.jpg', null, null);
INSERT INTO `t_news` VALUES ('147', '27', 'Gringo is an offensively unfunny film, writes BRIAN VINER ', 'Oyelowo plays Harold, a mild-mannered middle-manager, originally from Nigeria, in a Chicago pharmaceuticals company. Edgerton is his obnoxious boss, Richard.', '2018-03-09 01:33:13', 'http://www.dailymail.co.uk/tvshowbiz/article-5480363/Gringo-offensively-unfunny-film-writes-BRIAN-VINER.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/09/00/49F5FEDF00000578-0-Gringo_is_a_horribly_misbegotten_stab_at_a_black_comedy_thriller-a-6_1520557018407.jpg', null, null);
INSERT INTO `t_news` VALUES ('148', '27', 'BRIAN VINER says it\'s no wonder Oprah can’t save A Wrinkle In Time', 'Sci-fi film A Wrinkle In Time is a bit of a mess and owes a fair amount of its box-office appeal to the presence of Oprah Winfrey, writes BRIAN VINER.', '2018-03-23 01:12:12', 'http://www.dailymail.co.uk/tvshowbiz/article-5534421/BRIAN-VINER-says-no-wonder-Oprah-save-Wrinkle-Time.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/23/01/4A74AE6400000578-0-image-m-20_1521766879842.jpg', null, null);
INSERT INTO `t_news` VALUES ('149', '27', 'BAZ BAMIGBOYE: London opens its heart to sweet Caroline', 'Award-winning American playwright Tony Kushner has praised the British cast of his musical Caroline, Or Change and expressed his excitement about its transfer into the West End this autumn.', '2018-03-23 01:20:26', 'http://www.dailymail.co.uk/tvshowbiz/article-5534445/BAZ-BAMIGBOYE-London-opens-heart-sweet-Caroline.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/23/01/4A73F14B00000578-0-image-a-3_1521767661007.jpg', null, null);
INSERT INTO `t_news` VALUES ('150', '27', 'BAZ BAMIGBOYE: Adrienne Warren\'s simple the best as Tina Turner  ', 'Adrienne Warren, who portrays Turner in the musical Tina, which began previewing at the Aldwych Theatre on Wednesday, totally captures that heat, and paradise, too.', '2018-03-23 01:56:53', 'http://www.dailymail.co.uk/tvshowbiz/article-5534531/BAZ-BAMIGBOYE-Adrienne-Warrens-simple-best-Tina-Turner.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/23/01/4A75045F00000578-0-image-m-31_1521769434365.jpg', null, null);
INSERT INTO `t_news` VALUES ('151', '27', 'Spielberg takes us on an exhilarating sci-fi joyride', 'Anyone who wants to plunge back into the Eighties this Easter Weekend can either go to see Nik Kershaw in concert in Bridlington, or see Ready Player One at their nearest multiplex.', '2018-03-30 02:00:14', 'http://www.dailymail.co.uk/tvshowbiz/article-5560703/Spielberg-takes-exhilarating-sci-fi-joyride.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/30/01/4A94423700000578-0-image-m-12_1522370799173.jpg', null, null);
INSERT INTO `t_news` VALUES ('152', '27', 'Richard Gere gears up with BBC for first UK TV role', 'The Hollywood star is expected to play Max, the daddy in MotherFatherSon, an eight-part thriller by Tom Rob Smith, alongside Billy Howle.', '2018-03-30 07:14:29', 'http://www.dailymail.co.uk/tvshowbiz/article-5560739/Richard-Gere-gears-BBC-UK-TV-role.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/30/01/4AAE9E8200000578-0-image-a-1_1522368564186.jpg', null, null);
INSERT INTO `t_news` VALUES ('153', '27', 'Lily James familiarises herself with Beatles\' hits for role', 'The actress, who appeared alongside Gary Oldman in Darkest Hour, has been cast in the film musical All You Need Is Love, written by Richard Curtis and directed by Danny Boyle.', '2018-03-30 07:17:09', 'http://www.dailymail.co.uk/tvshowbiz/article-5560747/Lily-James-familiarises-Beatles-hits-role.html', 'http://i.dailymail.co.uk/i/newpix/2018/03/30/01/4AACBE0200000578-0-image-a-1_1522369012135.jpg', null, null);
INSERT INTO `t_news` VALUES ('154', '27', 'BRIAN VINER: Emily Blunt shines in a horror flick', 'John Krasinski, who directed, co-wrote and stars in the superb A Quiet Place, might get more respect next time he arrives in England, writes BRIAN VINER.', '2018-04-06 10:16:30', 'http://www.dailymail.co.uk/tvshowbiz/article-5584203/BRIAN-VINER-Emily-Blunt-shines-horror-flick-turns-staying-silent-art-form.html', 'http://i.dailymail.co.uk/i/newpix/2018/04/06/01/4ADB533B00000578-0-image-m-8_1522974474264.jpg', null, null);
INSERT INTO `t_news` VALUES ('155', '27', 'TOWIE\'s Amber Turner flaunts her  figure in a skimpy red bikini', 'She\'s been caught up in a love triangle on the latest series of TOWIE.  So it was no wonder Amber Turner wanted to getaway from the drama as she hit the beach on Saturday while holidaying in Dubai.', '2018-04-07 13:57:31', 'http://www.dailymail.co.uk/tvshowbiz/article-5588907/TOWIEs-Amber-Turner-flaunts-incredible-figure-skimpy-red-bikini-hits-beach.html', 'http://i.dailymail.co.uk/i/newpix/2018/04/07/13/4AE909EB00000578-0-image-m-88_1523104675265.jpg', null, null);
INSERT INTO `t_news` VALUES ('156', '27', 'Amal Clooney dons quirky denim hotpants on dinner date with George', 'George and Amal Clooney show off their flair for fashion once again as they enjoyed a romantic dinner in Soho, New York on Friday.', '2018-04-07 16:47:00', 'http://www.dailymail.co.uk/tvshowbiz/article-5588873/Amal-Clooney-dons-quirky-denim-hotpants-leather-trousers-dinner-date-husband-George.html', 'http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE8E1F700000578-0-image-a-118_1523102356628.jpg', '<div id=\"js-article-text\" class=\"article-text wide \">\n            <div class=\"moduleFull\"><!--[if gte IE 8]><!--><div class=\"fff-banners\" style=\"margin-bottom: 15px;\">\n    <div id=\"fff-banner\"><a href=\"#http:&#x2F;&#x2F;i.dailymail.co.uk&#x2F;i&#x2F;newpix&#x2F;2018&#x2F;04&#x2F;07&#x2F;12&#x2F;4AE8557D00000578-5588873-image-a-109_1523101312689.jpg\"><img src=\"&#x2F;&#x2F;i.dailymail.co.uk&#x2F;i&#x2F;furniture&#x2F;fff&#x2F;fff-banner-wide.png\"></a></div>\n        <div id=\"fff-hub-banner\"><a href=\"http:&#x2F;&#x2F;www.dailymail.co.uk&#x2F;femail&#x2F;fashionfinder\" onclick=\"window.FFF.trackClickToFFFHub(\'top_banner\')\"><img src=\"&#x2F;&#x2F;i.dailymail.co.uk&#x2F;i&#x2F;furniture&#x2F;fff&#x2F;fff-hub-banner-wide.png\"></a></div>\n</div><!--<![endif]--></div><h1>Amal Clooney dons quirky denim hotpants over leather trousers on dinner date with husband George</h1>      \n      <p class=\"author-section byline-plain\">By\n\n<a target=\"_blank\" href=\"http://www.dailymail.co.uk/home/search.html?s=&amp;authornamef=Cecily+Snowball+For+Mailonline\" class=\"author\" rel=\"nofollow\">Cecily Snowball For Mailonline</a>\n\n\n</p><p class=\"byline-section\"><span class=\"article-timestamp article-timestamp-published\">\n  <span class=\"article-timestamp-label\">Published:</span>\n  13:31 BST, 7 April 2018\n</span>\n | <span class=\"article-timestamp article-timestamp-updated\">\n  <span class=\"article-timestamp-label\">Updated:</span>\n  16:47 B