%20are%20left%20in%20TEARS%20with%20finale%20performance%20as%20absent%20friend%20battles%20divorce%20and%20police%20charge%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589717%2FSaturday-Night-Takeaway-finale-Declan-Donnelly-leaves-fans-tears.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0ANoel%20Fielding%27s%20baby%20PICTURE%20EXCLUSIVE%3A%20Bake%20Off%20host%20steps%20out%20with%20newborn%20for%20the%20FIRST%20TIME%20since%20girlfriend%20Lliana%20Bird%20gives%20birth%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589213%2FNoel-Fielding-steps-newborn-TIME-girlfriend-Lliana-Bird-gives-birth.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0AVictoria%20Beckham%27s%20daughter%20Harper%2C%20six%2C%20follows%20in%20her%20mother%27s%20chic%20footsteps%20as%20she%20totes%C2%A0stylish%20handbag%20during%20family%20dinner%20in%20LA%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5588685%2FVictoria-Beckhams-daughter-Harper-6-follows-mothers-chic-footsteps-dinner-LA.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0A\">\n                <span class=\"wai\">e-mail</span>\n            </a>\n        </li>\n        <li class=\"share-icons\" id=\"shareLinkTop\">\n            <a class=\"js-sl share-link email_share_article-top\"\n               href=\"#socialLinks\"></a>\n            <script type=\"text/javascript\">\n          var twitterVia = \'DailyMailCeleb\';\n          DM.later(\'bundle\', function(){\n            DM.has(\'shareLinkTop\', \'shareLinks\', {\n                    \'id\': \'5588873\',\n                    \'title\': \'Amal Clooney looks quirky in denim cutoffs over leather trousers\',\n                    \'url\': \'http://www.dailymail.co.uk/tvshowbiz/article-5588873/Amal-Clooney-dons-quirky-denim-hotpants-leather-trousers-dinner-date-husband-George.html\',\n                    \'eTwitterStatus\': \' https://dailym.ai/2GF42ft via @\' + twitterVia,\n                    \'articleChannelFollowButton\': \'DailyMailCeleb\',\n                    \'isChannel\': false,\n                    \'hideEmail\': true,\n                    \'placement\': \'top\',\n                    \'anchor\': \'tl\'});\n          });\n\n\n            </script>\n        </li>\n    </ul>\n    <div class=\"share-count\">\n        <b>92</b>\n        <span>shares</span>\n    </div>\n    <a class=\"comments-count home\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5588873/Amal-Clooney-dons-quirky-denim-hotpants-leather-trousers-dinner-date-husband-George.html#comments\"> <span></span>\n        <p class=\"count-number\">         956</p>\n        <p class=\"count-text\">View <br> comments</p>\n    </a>\n    <script>\n        DM.later(\'bundle\', function(){\n            DMS.Article.init(\'top\');\n        });\n\n\n    </script>\n</div>\n</p><div itemprop=\"articleBody\"><p class=\"mol-para-with-font\">They are one of the most stylish couples in Hollywood.  </p><p class=\"mol-para-with-font\">And <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/george_clooney/index.html\">George</a> and <a style=\"font-weight: bold;\" target=\"_blank\" href=\"http://www.dailymail.co.uk/news/amal-clooney/index.html\" id=\"mol-9a812860-3a5f-11e8-9940-c7d3110f9dcc\">Amal Clooney</a> showed off their flair for fashion once again as they enjoyed a romantic dinner in Soho, <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" target=\"_blank\" href=\"http://www.dailymail.co.uk/news/new_york/index.html\">New York</a> on Friday.</p><p class=\"mol-para-with-font\">The Human Right\'s lawyer, 40, made sure all eyes were on her as she rocked an unusually quirky ensemble - combining thigh-skimming distressed denim cutoffs with black leather trousers.</p><div class=\"artSplitter mol-img-group\" style=\"style\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-9d626d3a8660a109\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/16/4AE8620A00000578-5588873-image-a-40_1523114940461.jpg\"\n         height=\"951\" width=\"634\" alt=\"Strange style: Amal Clooney, 40, rocked a quirky combo in her denim cutoffs and leather trousers while out with husband George in New York on Friday \" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-9d626d3a8660a109\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/16/4AE8620A00000578-5588873-image-a-40_1523114940461.jpg\" height=\"951\" width=\"634\" alt=\"Strange style: Amal Clooney, 40, rocked a quirky combo in her denim cutoffs and leather trousers while out with husband George in New York on Friday \" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Strange style: Amal Clooney, 40, rocked a quirky combo in her denim cutoffs and leather trousers while out with husband George in New York on Friday </p></div><p class=\"mol-para-with-font\">Amal is known for her sartorial excellence, and upped the style stakes once again in her chic black floral jacket, with a warming faux fur lining.</p><p class=\"mol-para-with-font\">Pairing her unique look with a classic black jumper, the barrister added height to her statuesque frame with chic black leather heels. </p><div><div class=\"related-carousel with-fb tvshowbiz\"\n     id=\"p-21\"\n     data-track-module=\"am-related_carousel^related_carousel\" data-track-selector=\".rotator-panels a:not([class*=external])\" data-track-pos=\"static\">\n  <div class=\"rotator bdrcc\">\n    <div class=\"rotator-title\">\n      <h2>RELATED ARTICLES</h2>\n      <ul class=\"rotator-pages link-xocc\">\n        <li class=\"rotator-prev\"><a href=\"#\" data-page=\"prev\">Previous</a></li>\n        <li><a href=\"#\" data-page=\"1\">1</a></li>\n        <li class=\"rotator-next\"><a href=\"#\" data-page=\"next\">Next</a></li>\n      </ul>\n    </div>\n    <ul class=\"rotator-panels link-bogr1 linkro-ccox\">\n        <li>\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5588117/George-Amal-Clooney-cut-elegant-figures-head-date-night-New-York.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/07/4AE7A77000000578-0-image-m-43_1523081491530.jpg\" width=\"62\" height=\"60\" />\n  <span>George and Amal Clooney cut elegant figures as they head out...</span>\n  \n</a>\n\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5588687/Jack-Nicholson-looks-good-spirits-enjoys-LA-Lakers-basketball-game-son-Ray.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/10/4AE84B0F00000578-0-image-m-75_1523094792528.jpg\" width=\"62\" height=\"60\" />\n  <span>Jack Nicholson looks in good spirits as he enjoys LA Lakers...</span>\n  \n</a>\n\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5587285/Amal-Clooney-oozes-glamour-leopard-print-dress-powder-blue-coat-steps-NYC.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/04/06/19/4AE4264C00000578-0-image-a-11_1523040191783.jpg\" width=\"62\" height=\"60\" />\n  <span>Amal Clooney oozes glamour in a leopard print dress and...</span>\n  \n</a>\n\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5588685/Victoria-Beckhams-daughter-Harper-6-follows-mothers-chic-footsteps-dinner-LA.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/10/4AE83DE600000578-0-image-m-72_1523093642705.jpg\" width=\"62\" height=\"60\" />\n  <span>Victoria Beckham\'s daughter Harper, six, follows in her...</span>\n  \n</a>\n\n      </li>\n    </ul>\n  </div>\n  <div class=\"fb\">\n    <h2>Share this article</h2>\n    <div class=\"share\"><span class=\"wai\">Share</span></div>\n    <div class=\"count\"><span>92</span> shares</div>\n  </div>\n</div>\n\n<script type=\"text/javascript\">\n DM.later(\'bundle\', function(){\n  if (DM.Rotator) {\n    new DM.Rotator(\'p-21\', {\n      pageSize: 1,\n      pageCount: 1.0,\n      activeClass:  \'active\',\n      rotate: false\n    });\n  }\n\n  $(\'#p-21 .share\').on(\'click\', function() {\n    DMS.Facebook.postToFB(\'related\');\n  });\n });\n</script>\n</div><p class=\"mol-para-with-font\">Amal - who shares nine-month-old twins Ella and Alexander with her acting hunk - polished off the eye-catching ensemble with a trendy black beret, which topped her glossy chestnut tresses. </p><p class=\"mol-para-with-font\">Injecting a pop of colour with her vibrant red lip, Amal walked hand-in-hand with her actor beau as they made their exit from the restaurant. </p><div class=\"artSplitter mol-img-group\" style=\"style\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-8d14773f33be6ff2\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE8557D00000578-5588873-image-a-109_1523101312689.jpg\"\n         height=\"951\" width=\"634\" alt=\"Date night: Amal is known for her sartorial excellence, and upped the style stakes once again in her chic black floral jacket, with a warming faux fur lining\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-8d14773f33be6ff2\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE8557D00000578-5588873-image-a-109_1523101312689.jpg\" height=\"951\" width=\"634\" alt=\"Date night: Amal is known for her sartorial excellence, and upped the style stakes once again in her chic black floral jacket, with a warming faux fur lining\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Date night: Amal is known for her sartorial excellence, and upped the style stakes once again in her chic black floral jacket, with a warming faux fur lining</p></div><div class=\"moduleFull\"><!--[if gte IE 8]><!--><script>\n    window.