ed a pair of light blue denim jeans and tan suede boots as he stuck close to Amal.</p><p class=\"mol-para-with-font\">George kicked some serious salt-and-pepper scruff across his sharp jawline as they walked through the streets, with the iconic actor seemingly taking a slip off the step causing him to grimace. </p><div class=\"artSplitter mol-img-group\" style=\"style\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-3867ca7fff204ea9\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE85DB200000578-0-image-a-108_1523100272349.jpg\"\n         height=\"768\" width=\"634\" alt=\"Unique: The Human Right\'s lawyer, 40, made sure all eyes were on her as she rocked a quirky ensemble - combining thigh-skimming distressed denim cutoffs with black leather trousers\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-3867ca7fff204ea9\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE85DB200000578-0-image-a-108_1523100272349.jpg\" height=\"768\" width=\"634\" alt=\"Unique: The Human Right\'s lawyer, 40, made sure all eyes were on her as she rocked a quirky ensemble - combining thigh-skimming distressed denim cutoffs with black leather trousers\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Unique: The Human Right\'s lawyer, 40, made sure all eyes were on her as she rocked a quirky ensemble - combining thigh-skimming distressed denim cutoffs with black leather trousers</p></div><div class=\"artSplitter mol-img-group\" style=\"style\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-dd9c0401f7d34ad5\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/16/4AE860EE00000578-5588873-image-a-41_1523114942520.jpg\"\n         height=\"886\" width=\"634\" alt=\"Finishing touches: Amal - who shares nine-month-old twins Ella and Alexander with her acting hunk - polished off the eye-catching ensemble with a trendy black beret\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-dd9c0401f7d34ad5\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/16/4AE860EE00000578-5588873-image-a-41_1523114942520.jpg\" height=\"886\" width=\"634\" alt=\"Finishing touches: Amal - who shares nine-month-old twins Ella and Alexander with her acting hunk - polished off the eye-catching ensemble with a trendy black beret\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Finishing touches: Amal - who shares nine-month-old twins Ella and Alexander with her acting hunk - polished off the eye-catching ensemble with a trendy black beret</p></div><p class=\"mol-para-with-font\">Amal, who has worked on a number of high profile cases throughout her career, stepped out as it was revealed that she will represent two journalists jailed in Burma.</p><p class=\"mol-para-with-font\">Wa Lone and Kyaw Soe Oo – reporters for the Reuters news agency – are being held in a Yangon prison after being arrested in December.</p><p class=\"mol-para-with-font\">They are being held under the country’s Official Secrets Act, a statute which carries a maximum prison sentence of 14 years.  </p><p class=\"mol-para-with-font\">Her latest case comes amid claims she recently threw open the doors of her family’s newly refurbished £10 million Berkshire mansion to renowned photographer Annie Leibovitz, for an ‘at home’ interview, set to be published in Vogue this year.</p><div class=\"artSplitter mol-img-group\" style=\"style\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-790ef0bfd5731391\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE4FF1300000578-5588873-image-a-110_1523101539734.jpg\"\n         height=\"952\" width=\"634\" alt=\"Busy mum: Amal, who has worked on a number of high profile cases, stepped out as it was revealed that she will represent two journalists jailed in Burma (pictured March 2018)\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-790ef0bfd5731391\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/4AE4FF1300000578-5588873-image-a-110_1523101539734.jpg\" height=\"952\" width=\"634\" alt=\"Busy mum: Amal, who has worked on a number of high profile cases, stepped out as it was revealed that she will represent two journalists jailed in Burma (pictured March 2018)\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Busy mum: Amal, who has worked on a number of high profile cases, stepped out as it was revealed that she will represent two journalists jailed in Burma (pictured March 2018)</p></div><div class=\"artSplitter mol-img-group\" style=\"style\"><div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-c2f830cb33c4193e\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/23A3065100000578-5588873-image-a-113_1523101573871.jpg\"\n         height=\"390\" width=\"634\" alt=\"Doting parents: Amal  shares nine-month-old twins Ella and Alexander with the acting veteran (pictured 2014)\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-c2f830cb33c4193e\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/12/23A3065100000578-5588873-image-a-113_1523101573871.jpg\" height=\"390\" width=\"634\" alt=\"Doting parents: Amal  shares nine-month-old twins Ella and Alexander with the acting veteran (pictured 2014)\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div><div class=\"clear\"></div><p class=\"imageCaption\">Doting parents: Amal  shares nine-month-old twins Ella and Alexander with the acting veteran (pictured 2014)</p></div><p class=\"mol-para-with-font\">In the unlikely event that the A-listers’ nine-bedroom property isn’t impressive enough, Amal also borrowed £7million of diamonds to wear for the occasion.</p><p class=\"mol-para-with-font\">A source close to the Clooneys told The Mail on Sunday: ‘This has been organised for a long while. It is Amal’s chance to do a sit-down interview and show the inside of her house. </p><p class=\"mol-para-with-font\">\'It will be a really special piece for her. She and George have put blood, sweat and tears into getting their house to be perfect, so it’s the ideal location to do this.’</p><p class=\"mol-para-with-font\">The choice of photographer is also significant, as Leibovitz took the pictures of Amal during the final fitting of her Oscar de la Renta wedding dress for the couple’s marriage in September 2014.</p><p class=\"mol-para-with-font\">However, it is understood that neither George, 56, nor their children will appear in the new pictures.</p><div class=\"moduleFull mol-video\"><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-2175014133112521155\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5588873/Amal-Clooney-dons-quirky-denim-hotpants-leather-trousers-dinner-date-husband-George.html#v-2175014133112521155\",\"isMobile\":false,\"duration\":23000,\"src\":\"http://video.dailymail.co.uk/video/mol/2017/03/29/2175014133112521155/1024x576_MP4_2175014133112521155.mp4\",\"source\":\"Getty\",\"playerId\":\"default\",\"title\":\"Amal Clooney arrives at Chatham House for speech on Syria war crime\",\"preload\":\"none\",\"initialVideo\":true,\"thumbnail\":\"http://i.dailymail.co.uk/i/pix/2017/03/29/21/3EC04C1C00000578-0-image-a-10_1490819305922.jpg\",\"poster\":\"http://i.dailymail.co.uk/i/pix/2017/03/29/21/3EC04C1C00000578-0-image-m-13_1490819313438.jpg\",\"syndicationService\":null,\"