INSERT INTO `t_news` VALUES ('158', '27', 'Cardi B hides figure in voluminous frilly dress amid pregnancy rumours ahead of SNL debut', 'The 25-year-old rapper wore a voluminous frilly dress to hide her figure, for the appearance at E11EVEN club in Miami, Florida on Feriday ahead of her SNL debut on Saturday', '2018-04-07 20:37:49', 'http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html', 'http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AEBA58E00000578-0-image-m-47_1523123008487.jpg', '<div id=\"js-article-text\" class=\"article-text wide \">\n            <div class=\"moduleFull\"><!--[if gte IE 8]><!--><!--<![endif]--></div><h1>Is she wearing a maternity dress? Cardi B hides figure in voluminous frilly dress amid pregnancy rumours ahead of SNL debut</h1>      \n      <p class=\"author-section byline-plain\">By\n\n<a target=\"_blank\" href=\"http://www.dailymail.co.uk/home/search.html?s=&amp;authornamef=Dailymail.com+Reporter\" class=\"author\" rel=\"nofollow\">Dailymail.com Reporter</a>\n\n\n</p><p class=\"byline-section\"><span class=\"article-timestamp article-timestamp-published\">\n  <span class=\"article-timestamp-label\">Published:</span>\n  18:57 BST, 7 April 2018\n</span>\n | <span class=\"article-timestamp article-timestamp-updated\">\n  <span class=\"article-timestamp-label\">Updated:</span>\n  20:37 BST, 7 April 2018\n</span>\n</p><p><div id=\"articleIconLinksContainer\">\n    <ul>\n        <li class=\"share-facebook\"></li>\n        <li class=\"share-twitter\"></li>\n        <li class=\"share-pinterest\"></li>\n        <li class=\"share-gplus\">\n      <span class=\"g-interactivepost\"\n            data-contenturl=\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html\"\n            data-contentdeeplinkid=\"/pages\"\n            data-clientid=\"746589970956-e10ciaf67a1id9ggu75ph3ds0sthn7j6.apps.googleusercontent.com\"\n            data-cookiepolicy=\"single_host_origin\"\n            data-prefilltext=\"Is she wearing a maternity dress? Cardi B hides figure in voluminous frilly dress amid pregnancy rumours ahead of SNL debut\"\n            data-calltoactionlabel=\"VIEW\"\n            data-calltoactionurl=\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html\">\n        <a></a>\n      </span>\n        </li>\n        <li class=\"share-email\">\n            <a rel=\"nofollow\" href=\"mailto:?subject=Read this: Is she wearing a maternity dress? Cardi B hides figure in voluminous frilly dress amid pregnancy rumours ahead of SNL debut&amp;body=Is%20she%20wearing%20a%20maternity%20dress%3F%20Cardi%20B%20hides%20figure%20in%20voluminous%20frilly%20dress%20amid%20pregnancy%20rumours%20ahead%20of%20SNL%20debut%0A%0AThe%2025-year-old%20rapper%20wore%20a%20voluminous%20frilly%20dress%20to%20hide%20her%20figure%2C%20for%20the%20appearance%20at%20E11EVEN%20club%20in%20Miami%2C%20Florida%20on%20Feriday%20ahead%20of%20her%20SNL%20debut%20on%20Saturday%0A%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589499%2FCardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html%3Fito%3Demail_share_article-top%0A%0A%0AMost%20Read%20Articles%3A%0A%0A%27I%20miss%20him%27%3A%20Declan%20Donnelly%20admits%20Saturday%20Night%20Takeaway%20has%20been%20%27tinged%20with%20sadness%27%20without%20Ant%20McPartlin%E2%80%A6%20as%20fans%20are%20left%20in%20TEARS%20with%20finale%20performance%20as%20absent%20friend%20battles%20divorce%20and%20police%20charge%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589717%2FSaturday-Night-Takeaway-finale-Declan-Donnelly-leaves-fans-tears.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0ANoel%20Fielding%27s%20baby%20PICTURE%20EXCLUSIVE%3A%20Bake%20Off%20host%20steps%20out%20with%20newborn%20for%20the%20FIRST%20TIME%20since%20girlfriend%20Lliana%20Bird%20gives%20birth%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589213%2FNoel-Fielding-steps-newborn-TIME-girlfriend-Lliana-Bird-gives-birth.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0AVictoria%20Beckham%27s%20daughter%20Harper%2C%20six%2C%20follows%20in%20her%20mother%27s%20chic%20footsteps%20as%20she%20totes%C2%A0stylish%20handbag%20during%20family%20dinner%20in%20LA%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5588685%2FVictoria-Beckhams-daughter-Harper-6-follows-mothers-chic-footsteps-dinner-LA.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0A\">\n                <span class=\"wai\">e-mail</span>\n            </a>\n        </li>\n        <li class=\"share-icons\" id=\"shareLinkTop\">\n            <a class=\"js-sl share-link email_share_article-top\"\n               href=\"#socialLinks\"></a>\n            <script type=\"text/javascript\">\n          var twitterVia = \'DailyMailCeleb\';\n          DM.later(\'bundle\', function(){\n            DM.has(\'shareLinkTop\', \'shareLinks\', {\n                    \'id\': \'5589499\',\n                    \'title\': \'Cardi B hides figure in voluminous frilly dress amid pregnancy rumours\',\n                    \'url\': \'http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html\',\n                    \'eTwitterStatus\': \' https://dailym.ai/2Es1hIv via @\' + twitterVia,\n                    \'articleChannelFollowButton\': \'DailyMailCeleb\',\n                    \'isChannel\': false,\n                    \'hideEmail\': true,\n                    \'placement\': \'top\',\n                    \'anchor\': \'tl\'});\n          });\n\n\n            </script>\n        </li>\n    </ul>\n    <div class=\"share-count\">\n        <b>7</b>\n        <span>shares</span>\n    </div>\n    <a class=\"comments-count home\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html#comments\"> <span></span>\n        <p class=\"count-number\">          97</p>\n        <p class=\"count-text\">View <br> comments</p>\n    </a>\n    <script>\n        DM.later(\'bundle\', function(){\n            DMS.Article.init(\'top\');\n        });\n\n\n    </script>\n</div>\n</p><div itemprop=\"articleBody\"><p class=\"mol-para-with-font\">She\'s set to make her first appearance on Saturday Night Live on Saturday, to coincide with her album release. </p><p class=\"mol-para-with-font\">And Cardi B was doing nothing to quash pregnancy rumours as she performed a warm-up gig on Friday night.</p><p class=\"mol-para-with-font\">The 25-year-old rapper wore a voluminous frilly dress to hide her figure, for the appearance at E11EVEN club in Miami, <a style=\"font-weight: bold;\" target=\"_blank\" href=\"http://www.dailymail.co.uk/news/florida/index.html\" id=\"mol-2d5b0660-3a8d-11e8-b683-ddffe512179f\">Florida</a>. </p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-c2f25dc64ff42993\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8338E00000578-5589499-image-m-35_1523121542255.jpg\"\n         height=\"926\" width=\"634\" alt=\"Baggy dress: Cardi B was doing nothing to quash pregnancy rumours as she performed a warm-up gig on Friday night\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-c2f25dc64ff42993\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8338E00000578-5589499-image-m-35_1523121542255.jpg\" height=\"926\" width=\"634\" alt=\"Baggy dress: Cardi B was doing nothing to quash pregnancy rumours as she performed a warm-up gig on Friday night\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Baggy dress: Cardi B was doing nothing to quash pregnancy rumours as she performed a warm-up gig on Friday night</p></div><p class=\"mol-para-with-font\">The metallic off-the-shoulder puffy pink gown swamped the Bronx-native, fueling speculation she\'s expecting a baby with Migos rapper Offset. </p><p class=\"mol-para-with-font\">The Bodack Yellow hitmaker, who has kept silent on the subject, sported a vamped up platinum hair-do. </p><div><div class=\"related-carousel with-fb tvshowbiz half\"\n     id=\"p-21\"\n     data-track-module=\"am-related_carousel^related_carousel\" data-track-selector=\".rotator-panels a:not([class*=external])\" data-track-pos=\"static\">\n  <div class=\"rotator bdrcc\">\n    <div class=\"rotator-title\">\n      <h2>RELATED ARTICLES</h2>\n      <ul class=\"rotator-pages link-xocc\">\n        <li class=\"rotator-prev\"><a href=\"#\" data-page=\"prev\">Previous</a></li>\n        <li><a href=\"#\" data-page=\"1\">1</a></li>\n        <li><a href=\"#\" data-page=\"2\">2</a></li>\n        <li class=\"rotator-next\"><a href=\"#\" data-page=\"next\">Next</a></li>\n      </ul>\n    </div>\n    <ul class=\"rotator-panels link-bogr1 linkro-ccox\">\n        <li>\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5584477/Cardi-B-addresses-pregnancy-rumors-Tells-fans-tune-debut-album-answers.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/04/06/04/4ADE994600000578-0-image-m-33_1522986992726.jpg\" width=\"62\" height=\"60\" />\n  <span>Cardi B folds her arms over her stomach in NYC after...</span>\n  \n</a>\n\n        <a target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5468825/Migos-sued-inciting-riot-resulting-stabbed-concertgoers.html\"\n\n  >\n  <img src=\"http://i.dailymail.co.uk/i/newpix/2018/03/06/15/49ED242300000578-0-image-m-3_1520350482971.jpg\" width=\"62\" height=\"60\" />\n  <span>Hit hip-hop group Migos sued for inciting riot which...</span>\n  \n</a>\n\n  