_voluminous_frilly_dre-a-17_1523123708592.jpg\" height=\"955\" width=\"634\" alt=\"Stepping out: The 25-year-old rapper wore a voluminous frilly dress to hide her figure, for the appearance at E11EVEN club in Miami, Florida\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Stepping out: The 25-year-old rapper wore a voluminous frilly dress to hide her figure, for the appearance at E11EVEN club in Miami, Florida</p></div><div class=\"moduleFull\"><!--[if gte IE 8]><!--><!--<![endif]--></div><p class=\"mol-para-with-font\">Her nails certainly didn\'t look ready to change a diaper any time soon, as they were fiercely long and pointed, with a metallic polish. </p><p class=\"mol-para-with-font\">The star - whose debut album is aptly titled Invasion Of Privacy -  has insisted she won\'t comment on the reports she\'s expecting a baby with her fiance. </p><p class=\"mol-para-with-font\">The artist explained on Thursday why she was staying silent, telling people that they should listen to her upcoming album if they want to discover things she\'d rather rap about than talk about, during an interview on <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" href=\"https://www.youtube.com/watch?v=6zBvet8J4ZQ\">Apple Music</a> out Thursday.</p><div class=\"moduleFull mol-video\"><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-1984464713968629636\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html#v-1984464713968629636\",\"isMobile\":false,\"duration\":29000,\"src\":\"http://video.dailymail.co.uk/video/mol/2018/02/08/1984464713968629636/1024x576_MP4_1984464713968629636.mp4\",\"source\":\"Instagram\",\"playerId\":\"default\",\"title\":\"Cardi B commands attention in sexy sheer skin-tight body