_Belcalis_Almanzar-a-22_1523123709633.jpg\"\n         height=\"421\" width=\"634\" alt=\"Sole survivor: The musician - whose given name is Belcalis Almanzar - certainly didn\'t have puffy ankles to worry about - showcasing her nicely turned ankles in vertiginous Christian Louboutin silver heels\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-4205be2129ceeeeb\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8337F00000578-5589499-Sole_survivor_The_musician_whose_given_name_is_Belcalis_Almanzar-a-22_1523123709633.jpg\" height=\"421\" width=\"634\" alt=\"Sole survivor: The musician - whose given name is Belcalis Almanzar - certainly didn\'t have puffy ankles to worry about - showcasing her nicely turned ankles in vertiginous Christian Louboutin silver heels\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Sole survivor: The musician - whose given name is Belcalis Almanzar - certainly didn\'t have puffy ankles to worry about - showcasing her nicely turned ankles in vertiginous Christian Louboutin silver heels</p></div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-d9860b40532a553c\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8349E00000578-5589499-Keeping_mum_The_star_whose_debut_album_is_aptly_titled_Invasion_-a-24_1523123709740.jpg\"\n         height=\"419\" width=\"634\" alt=\"Keeping mum: The star - whose debut album is aptly titled Invasion Of Privacy - has insisted she won\'t comment on the reports she\'s expecting a baby with her fiance\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-d9860b40532a553c\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8349E00000578-5589499-Keeping_mum_The_star_whose_debut_album_is_aptly_titled_Invasion_-a-24_1523123709740.jpg\" height=\"419\" width=\"634\" alt=\"Keeping mum: The star - whose debut album is aptly titled Invasion Of Privacy - has insisted she won\'t comment on the reports she\'s expecting a baby with her fiance\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Keeping mum: The star - whose debut album is aptly titled Invasion Of Privacy - has insisted she won\'t comment on the reports she\'s expecting a baby with her fiance</p></div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-7d935b71f70fe65b\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8335300000578-5589499-Hot_right_now_She_s_set_to_make_her_first_appearance_on_Saturday-a-23_1523123709684.jpg\"\n         height=\"914\" width=\"634\" alt=\"Hot right now: She\'s set to make her first appearance on Saturday Night Live on Saturday, to coincide with her album release\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-7d935b71f70fe65b\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AE8335300000578-5589499-Hot_right_now_She_s_set_to_make_her_first_appearance_on_Saturday-a-23_1523123709684.jpg\" height=\"914\" width=\"634\" alt=\"Hot right now: She\'s set to make her first appearance on Saturday Night Live on Saturday, to coincide with her album release\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Hot right now: She\'s set to make her first appearance on Saturday Night Live on Saturday, to coincide with her album release</p></div><p class=\"mol-para-with-font\">Speaking to Ebro Darden, the starlet said: \'I feel like people just got to tune in a little bit on my album and they will know a little bit more because I can\'t address all the rumors and everything. </p><p class=\"mol-para-with-font\">\'I have been so open to people about myself. People cannot expect me to be open about everything. Certain things to me, it has to be private. You cannot invade my privacy,\' said B ahead of her Friday album release.</p><p class=\"mol-para-with-font\">Cardi - who became engaged to Offset in October last year - blasted the idea that she should be open like an \'animal in the zoo\', and hinted that people would only know if she was pregnant \'if it [the baby] arrives\'.</p><p class=\"mol-para-with-font\">Speaking during an interview for Beats 1 Radio, Cardi said: \'I\'m not a damn animal at the zoo that you just could see everything, no. People will just find out more. If it arrives, if it don\'t arrive, then you gonna know what the f**k is going on.\'</p><p class=\"mol-para-with-font\">At the beginning of December, 2017, Cardi B said that she and  Offset plan to spend $1 million on their wedding.</p><div class=\"moduleFull mol-video\"><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-1852434159556474369\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html#v-1852434159556474369\",\"isMobile\":false,\"duration\":131000,\"src\":\"http://video.dailymail.co.uk/video/mol/2018/01/28/1852434159556474369/1024x576_MP4_1852434159556474369.mp4\",\"source\":\"CelebrityFootage\",\"playerId\":\"default\",\"title\":\"Work it, own it! Cardi B teases paps at Clive Davis Pre-Grammy\",\"preload\":\"none\",\"initialVideo\":true,\"thumbnail\":\"http://i.dailymail.co.uk/i/pix/2018/01/28/03/48A6EDB300000578-0-image-m-10_1517111540569.jpg\",\"poster\":\"http://i.dailymail.co.uk/i/pix/2018/01/28/03/48A6EDB300000578-0-image-m-11_1517111540569.jpg\",\"syndicationService\":null,\"plugins\":{\"social-share\":{\"embedUrl\":\"http://www.dailymail.co.uk/embed/video/1616586.html\"},\"autoplay-next-video\":{\