":{\"articleURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html\"}}}\' preload=\"none\">\n    <source src=\"http://video.dailymail.co.uk/video/mol/2018/01/28/1852434159556474369/1024x576_MP4_1852434159556474369.mp4\" type=\'video/mp4\'/>\n  </video>\n</div>\n\n</div>\n</div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-e68a189cc6addc4b\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/03/06/18/49ED24DC00000578-5468825-Loved_up_One_member_Offset_is_also_engaged_to_rapper_Cardi_B_who-a-1_1520361350522.jpg\"\n         height=\"953\" width=\"634\" alt=\"Loved up: One member Offset is also engaged to rapper Cardi B who happens to be the hottest up-and-comer in hip-hop, as the couple are pictured together in February\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-e68a189cc6addc4b\" src=\"http://i.dailymail.co.uk/i/newpix/2018/03/06/18/49ED24DC00000578-5468825-Loved_up_One_member_Offset_is_also_engaged_to_rapper_Cardi_B_who-a-1_1520361350522.jpg\" height=\"953\" width=\"634\" alt=\"Loved up: One member Offset is also engaged to rapper Cardi B who happens to be the hottest up-and-comer in hip-hop, as the couple are pictured together in February\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Loved up: One member Offset is also engaged to rapper Cardi B who happens to be the hottest up-and-comer in hip-hop, as the couple are pictured together in February</p></div><div class=\"moduleFull mol-video\"><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-5357736145438553889\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html#v-5357736145438553889\",\"isMobile\":false,\"duration\":102000,\"src\":\"http://video.dailymail.co.uk/video/mol/2017/10/07/5357736145438553889/1024x576_MP4_5357736145438553889.mp4\",\"source\":\"Instagram\",\"playerId\":\"default\",\"title\":\"Cardi B hangs with Offset & Migos at BET Hip Hop Awards in Miami\",\"preload\":\"none\",\"initialVideo\":true,\"thumbnail\":\"http://i.dailymail.co.uk/i/pix/2017/10/07/20/4521518400000578-0-image-m-4_1507406137074.jpg\",\"poster\":\"http://i.dailymail.co.uk/i/pix/2017/10/07/20/4521518400000578-0-image-m-5_1507406137074.jpg\",\"syndicationService\":null,\"plugins\":{\"social-share\":{\"embedUrl\":\"http://www.dailymail.co.uk/embed/video/1550607.html\"},\"autoplay-next-video\":{\"videos\":\"http://www.dailymail.co.uk/api/player/1550607/related-videos.json\",\"countdown_time\":10},\"ads-setup\":{\"videoAdServerUrl\":\"http://pubads.g.doubleclick.net/gampad/ads?sz=[size]&iu=%2F5765%2Fdm.video%2Fdm_video_tvshowbiz&ciu_szs=&impl=s&gdfp_req=1&env=vp&output=xml_vast3&unviewed_position_start=1&url=[referrer_url]&correlator=[timestamp]\",\"adsEnabled\":true,\"adsCancelTimeout\":15000,\"screen\":{\"width\":636,\"height\":358}},\"sources\":{\"url\":\"http://www.dailymail.co.uk/api/player/5357736145438553889/video-sources.json\"},\"flyout\":{\"viewportOffset\":0.4,\"switchBack\":true,\"forceFlyout\":{\"active\":false,\"muted\":true,\"switchBack\":false}},\"tracking\":{\"channelShortName\":\"tvshowbiz\",\"sponsored\":null,\"referenceId\":1550607,\"trackingType\":\"embedded\"},\"autoplay-inline\":{\"enabled\":false},\"animated-preview\":{\"data-hd-fps\":7,\"data-hd-frame-count\":35,\"frames\":76,\"width\":636,\"src\":\"http://video.dailymail.co.uk/preview/mol/2017/10/07/2123611085532020529/636x382_JPG-SINGLE_2123611085532020529.jpg\",\"fps\":0,\"data-film\":\"http://video.dailymail.co.uk/preview/mol/2017/10/07/2123611085532020529/308x174_JPG_2123611085532020529.jpg\",\"data-fps\":7,\"data-video\":\"http://video.dailymail.co.uk/preview/mol/2017/10/07/2123611085532020529/636x382_MP4_2123611085532020529.mp4\",\"data-hd-film\":\"http://video.dailymail.co.uk/preview/mol/2017/10/07/2123611085532020529/636x382_JPG-HD_2123611085532020529.jpg\",\"data-hd-frame-width\":636,\"data-frame-height\":172,\"data-frame-width\":308,\"data-frame-count\":35,\"height\":356,\"data-hd-frame-height\":356},\"related-videos\":{\"videos\":\"http://www.dailymail.co.uk/api/player/1550607/related-videos.json\"}},\"videoId\":\"5357736145438553889\",\"descr\":\"Cardi B hangs with boyfriend Offset & Migos at BET Hip Hop Awards in Miami. Cardi wore her raven locks in a high ponytail and wore a revealing silver dress with slits up both thighs and purple in back.\",\"referenceId\":1550607,\"grapeshot\":{\"article\":{\"articleURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html\"}}}\' preload=\"none\">\n    <source src=\"http://video.dailymail.co.uk/video/mol/2017/10/07/5357736145438553889/1024x576_MP4_5357736145438553889.mp4\" type=\'video/mp4\'/>\n  </video>\n</div>\n\n</div>\n</div><p class=\"mol-para-with-font\">\'We\'re going to spend over a million,\' she <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5137049/Cardi-B-splash-1million-wedding-fiance-Offset.html\">told </a>BBC Radio One’s Charlie Sloth. </p><p class=\"mol-para-with-font\">The pregnancy rumors come after Offset\'s iCloud was hacked and photos and footage was leaked of him with another girl.</p><p class=\"mol-para-with-font\">Cardi forgave her beau for the gaffe, and said she doesn\'t owe an explanation to those who wonder why she didn\'t leave the star.</p><p class=\"mol-para-with-font\">She said: \'It\'s like everybody is coming down my neck like, \"Why are you not leaving him? You have low self-esteem.\"  </p><p class=\"mol-para-with-font\">\'I don\'t have low self-esteem ... I know I look good. I know I\'m rich, I know I\'m talented. I know I could get any man I want - any basketball player, football player.</p><p class=\"mol-para-with-font\">\'But I want to work out my s**t with my man, and I don\'t got to explain why. I\'m not your property. This is my life... I\'m going to take my time, and I\'m going to decide on my decision... </p><p class=\"mol-para-with-font\">\'It\'s not right, what he f***ing did, but people don\'t know what I did, \'cause I ain\'t no angel.\' </p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-4d7137dd80b3727d\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AC6CC8A00000578-5589499-While_Cardi_was_willing_to_forgive_the_Motorsport_rapper_seen_in-a-25_1523123709910.jpg\"\n         height=\"495\" width=\"634\" alt=\"While Cardi was willing to forgive the Motorsport rapper (seen in her Bartier Crdi video above) for his indiscretion, she was less understanding about people\'s unsolicited advice, saying \'It\'s like everybody is coming down my neck\'\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-4d7137dd80b3727d\" src=\"http://i.dailymail.co.uk/i/newpix/2018/04/07/18/4AC6CC8A00000578-5589499-While_Cardi_was_willing_to_forgive_the_Motorsport_rapper_seen_in-a-25_1523123709910.jpg\" height=\"495\" width=\"634\" alt=\"While Cardi was willing to forgive the Motorsport rapper (seen in her Bartier Crdi video above) for his indiscretion, she was less understanding about people\'s unsolicited advice, saying \'It\'s like everybody is coming down my neck\'\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">While Cardi was willing to forgive the Motorsport rapper (seen in her Bartier Crdi video above) for his indiscretion, she was less understanding about people\'s unsolicited advice, saying \'It\'s like everybody is coming down my neck\'</p></div><p class=\"mol-para-with-font\">Last year, she signed a record deal with Atlantic Records, whose other artists include Bruno Mars and <a style=\"font-weight: bold;\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/ed_sheeran/index.html\" id=\"mol-2d4dbdc0-3a7e-11e8-824e-9bcaa1f312f4\">Ed Sheeran</a>.</p><p class=\"mol-para-with-font\">Cardi B’s ‘Bodak Yellow’ topped <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" rel=\"nofollow\" href=\"http://www.billboard.com/articles/columns/chart-beat/7990506/j-balvin-willy-william-beyonce-cardi-b-hot-100\">Billboard 100</a> for three consecutive weeks and her boyfriend, Migos’ Offset, became her fiancé when he <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-5026221/Cardi-B-says-yes-Migos-Offset-proposes-stage.html\">proposed </a>to her in October.   </p><p class=\"mol-para-with-font\">Her <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" rel=\"nofollow\" href=\"https://bossip.com/1256939/hate-it-or-love-it-shaggy-feat-popcaan-cardi-b-boom-boom-listen/\">first </a>music appearance was in November 2015, on Shaggy’s ‘Boom Boom’ remix single.</p><p class=\"mol-para-with-font\">Following two mixtapes, <span class=\"mol-style-italic\">Gangsta B*tch Music, Vol. 1 </span>and <span class=\"mol-style-italic\">Gangsta B*tch, Vol. 2</span>, the rapper signed a record deal with Atlantic Records in February, 2017.</p><p class=\"mol-para-with-font\">In May of the same year, Cardi B was <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" rel=\"nofollow\" href=\"https://www.bet.com/music/2017/05/15/cardi-b-reaction-to-being-nominated-for-a-bet-award.html\">nominated </a>for Best New Artist and Best Female Hip-Hop Artist at the 2017 <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/bet_awards/index.html\">BET Awards</a>.</p><p class=\"mol-para-with-font\">In January 2018, Cardi B surpassed <a style=\"font-weight: bold;\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/beyonce/index.html\" id=\"mol-e6c39980-3a85-11e8-824e-9bcaa1f312f4\">Beyonce</a> as the first female artist to have five Top 10 singles in the Billboard Hot R&amp;B/Hip-Hop chart <a style=\"font-weight: bold;\" target=\"_blank\" class=\"class\" rel=\"nofollow\" href=\"http://edition.cnn.com/2018/01/18/entertainment/cardi-beyonce-chart-record/index.html\">in the same week</a>.   </p><p class=\"mol-para-with-font\">She is also featured on Bruno Mars’s ‘Finesse (Remix)’ and appeared in the accompanying 90s video.</p><div class=\"moduleFull mol-video\"><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-5892204182591353131\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-5589499/Cardi-B-hides-figure-voluminous-frilly-dress-amid-pregnancy-rumours-ahead-SNL-debut.html#v-5892204182591353131\",\"isMobile\":false,\"duration\":59000,\"src\":\"http://video.dailymail.co.uk/video/mol/2018/03/29/5892204182591353131/1024x576_MP4_5892204182591353131.mp4\",\"source\":\"Instagram\",\"playerId\":\"default\",\"title\":\"Cardi B gives preview of one of her upcoming songs for fans\",\"preload\":\"none\",\"initialVideo\":true,\"thumbnail\":\"http://i.dailymail.co.uk/i/newpix/2018/03/29/18/4AAC395000000578-0-image-m-4_1522344854284.jpg\",\"poster\":\"http://i.dailymail.co.uk/i/newpix/2018/03/29/18/4AAC395000000578-0-image-a-1_1522344844369.jpg\",\"syndicationService\":null,\"plugins\":{\"social-share\":{\"embedUrl\":\"http://www.dailymail.co.uk/embed/video/1659322.html\"},\"autoplay-next-video\":{\"videos\":\"http://ww