INSERT INTO `t_news` VALUES ('171', '28', 'Hugh Laurie wanted to star in The Night Manager', 'Hugh Laurie shattered the mould with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBC’s The Night Manager (pictured). But could he have played the hero?', '2017-06-09 02:27:10', 'http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/02/317B84BD00000578-0-image-m-68_1496971376015.jpg', '<div id=\"js-article-text\" class=\"article-text wide \">\n            <h1>I wanted to be the Night Manager - until I lost my hair! Hugh Laurie reveals why he didn\'t play the hero in the TV blockbuster - and he can\'t stop teasing Tom Hiddleston about 007</h1>      \n      <p class=\"author-section byline-plain\">By\n\n<a target=\"_blank\" href=\"http://www.dailymail.co.uk/home/search.html?s=&amp;authornamef=Gabrielle+Donnelly+For+The+Daily+Mail\" class=\"author\" rel=\"nofollow\">Gabrielle Donnelly For The Daily Mail</a>\n\n\n</p><p class=\"byline-section\"><span class=\"article-timestamp article-timestamp-published\">\n  <span class=\"article-timestamp-label\">Published:</span>\n  02:23 BST, 9 June 2017\n</span>\n | <span class=\"article-timestamp article-timestamp-updated\">\n  <span class=\"article-timestamp-label\">Updated:</span>\n  02:27 BST, 9 June 2017\n</span>\n</p><p><div id=\"articleIconLinksContainer\">\n    <ul>\n        <li class=\"share-facebook\"></li>\n        <li class=\"share-twitter\"></li>\n        <li class=\"share-pinterest\"></li>\n        <li class=\"share-gplus\">\n      <span class=\"g-interactivepost\"\n            data-contenturl=\"http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html\"\n            data-contentdeeplinkid=\"/pages\"\n            data-clientid=\"746589970956-e10ciaf67a1id9ggu75ph3ds0sthn7j6.apps.googleusercontent.com\"\n            data-cookiepolicy=\"single_host_origin\"\n            data-prefilltext=\"I wanted to be the Night Manager - until I lost my hair! Hugh Laurie reveals why he didn\'t play the hero in the TV blockbuster - and he can\'t stop teasing Tom Hiddleston about 007 \"\n            data-calltoactionlabel=\"VIEW\"\n            data-calltoactionurl=\"http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html\">\n        <a></a>\n      </span>\n        </li>\n        <li class=\"share-email\">\n            <a rel=\"nofollow\" href=\"mailto:?subject=Read this: I wanted to be the Night Manager - until I lost my hair! Hugh Laurie reveals why he didn\'t play the hero in the TV blockbuster - and he can\'t stop teasing Tom Hiddleston about 007 &amp;body=I%20wanted%20to%20be%20the%20Night%20Manager%20-%20until%20I%20lost%20my%20hair%21%20Hugh%20Laurie%20reveals%20why%20he%20didn%27t%20play%20the%20hero%20in%20the%20TV%20blockbuster%20-%20and%20he%20can%27t%20stop%20teasing%20Tom%20Hiddleston%20about%20007%C2%A0%0A%0AHugh%20Laurie%20shattered%20the%20mould%20with%20his%20spine-tingling%20menace%20as%20the%20billionaire%20arms%20dealer%20Richard%20Roper%20in%20BBC%E2%80%99s%20The%20Night%20Manager%20%28pictured%29.%20But%20could%20he%20have%20played%20the%20hero%3F%0A%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-4586930%2FHugh-Laurie-wanted-Night-Manager.html%3Fito%3Demail_share_article-top%0A%0A%0AMost%20Read%20Articles%3A%0A%0A%27I%20miss%20him%27%3A%20Declan%20Donnelly%20admits%20Saturday%20Night%20Takeaway%20has%20been%20%27tinged%20with%20sadness%27%20without%20Ant%20McPartlin%E2%80%A6%20as%20fans%20are%20left%20in%20TEARS%20with%20finale%20performance%20as%20absent%20friend%20battles%20divorce%20and%20police%20charge%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589717%2FSaturday-Night-Takeaway-finale-Declan-Donnelly-leaves-fans-tears.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0ANoel%20Fielding%27s%20baby%20PICTURE%20EXCLUSIVE%3A%20Bake%20Off%20host%20steps%20out%20with%20newborn%20for%20the%20FIRST%20TIME%20since%20girlfriend%20Lliana%20Bird%20gives%20birth%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589213%2FNoel-Fielding-steps-newborn-TIME-girlfriend-Lliana-Bird-gives-birth.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0AVictoria%20Beckham%27s%20daughter%20Harper%2C%20six%2C%20follows%20in%20her%20mother%27s%20chic%20footsteps%20as%20she%20totes%C2%A0stylish%20handbag%20during%20family%20dinner%20in%20LA%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5588685%2FVictoria-Beckhams-daughter-Harper-6-follows-mothers-chic-footsteps-dinner-LA.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0A\">\n                <span class=\"wai\">e-mail</span>\n            </a>\n        </li>\n        <li class=\"share-icons\" id=\"shareLinkTop\">\n            <a class=\"js-sl share-link email_share_article-top\"\n               href=\"#socialLinks\"></a>\n            <script type=\"text/javascript\">\n          var twitterVia = \'DailyMailCeleb\';\n          DM.later(\'bundle\', function(){\n            DM.has(\'shareLinkTop\', \'shareLinks\', {\n                    \'id\': \'4586930\',\n                    \'title\': \'Hugh Laurie: I wanted to be the Night Manager - until I lost my hair!\',\n                    \'url\': \'http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html\',\n                    \'eTwitterStatus\': \' http://dailym.ai/2sZN93Q via @\' + twitterVia,\n                    \'articleChannelFollowButton\': \'DailyMailCeleb\',\n                    \'isChannel\': false,\n                    \'hideEmail\': true,\n                    \'placement\': \'top\',\n                    \'anchor\': \'tl\'});\n          });\n\n\n            </script>\n        </li>\n    </ul>\n    <div class=\"share-count\">\n        <b>79</b>\n        <span>shares</span>\n    </div>\n    <a class=\"comments-count home\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html#comments\"> <span></span>\n        <p class=\"count-number\">           3</p>\n        <p class=\"count-text\">View <br> comments</p>\n    </a>\n    <script>\n        DM.later(\'bundle\', function(){\n            DMS.Article.init(\'top\');\n        });\n\n\n    </script>\n</div>\n</p><div itemprop=\"articleBody\"><p class=\"mol-para-with-font\">Hugh Laurie made his name playing a dim-witted upper-class twit in Blackadder, and another in Jeeves And Wooster. Then he reinvented himself brilliantly as the curmudgeon Dr Gregory House — and became the highest-paid actor in America.</p><p class=\"mol-para-with-font\">Now, he’s teetering on the edge of the typecasting trap so many actors fall into . . . by playing another American doctor.</p><p class=\"mol-para-with-font\">This time he’s a neuropsychiatrist in a show called Chance, a thriller which has already gained him plaudits in America, and will be shown here later this month. In between those two medical roles, however, he shattered the mould in the most dramatic fashion with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBC’s The Night Manager. Starring alongside Tom Hiddleston, he won several awards, including a Golden Globe.</p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-8fca7fd580f4a955\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/317B84BD00000578-4586930-image-a-58_1496970852813.jpg\"\n         height=\"423\" width=\"634\" alt=\"Hugh Laurie shattered the mould with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBC¿s The Night Manager (pictured). But could he have played the hero?\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-8fca7fd580f4a955\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/317B84BD00000578-4586930-image-a-58_1496970852813.jpg\" height=\"423\" width=\"634\" alt=\"Hugh Laurie shattered the mould with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBC¿s The Night Manager (pictured). But could he have played the hero?\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Hugh Laurie shattered the mould with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBC’s The Night Manager (pictured). But could he have played the hero?</p></div><p class=\"mol-para-with-font\">‘I was surprised, actually,’ Laurie tells me when we meet for coffee in Beverly Hills. ‘Well, I’m always surprised that anything I do goes from beginning to end without causing people to throw bottles and rotten vegetables at the screen.</p><p class=\"mol-para-with-font\">‘I never assume that I’ve done anything that is going to interest or touch people in any way, so the fact that we managed to strike such a chord with this one did amaze me. But it did seem to do very well, didn’t it? I was very proud of that.’</p><p class=\"mol-para-with-font\">And with success has come an avalanche of offers which have made it even harder for him to fulfil his dream of selling up in Los Angeles — where one of his new neighbours is his former comedy partner Stephen Fry — and returning to live in Britain permanently.</p><p class=\"mol-para-with-font\">‘I don’t actually know where I live right now,’ he says. ‘There won’t be anything to keep me in America for a block of time on the scale of House [which ran for eight series], because they aren’t making TV shows like that any more. But on the other hand, I do seem to be still working in America a lot. It’s just something I have sort of got used to.</p><p class=\"mol-para-with-font\">‘I have certainly amassed an awful lot of air miles over the years — I could probably bankrupt Virgin if I cashed them in all at once.</p><p class=\"mol-para-with-font\">‘There was a time when California felt a lot further away from England because you couldn’t get things like tea bags or Marmite or decent cheese. But the world has got a lot smaller these days, and you can get all those things there now — you can even get McVitie’s digestive biscuits, so life is bearable.’</p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-3eff86e78b224d15\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/31CEC54B00000578-4586930-image-a-59_1496970874371.jpg\"\n         height=\"423\" width=\"634\" alt=\"Hugh Laurie (right) says he regularly winds up his co-star Tom Hiddleston about the possibility of being the next James Bond\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-3eff86e78b224d15\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/31CEC54B00000578-4586930-image-a-59_1496970874371.jpg\" height=\"423\" width=\"634\" alt=\"Hugh Laurie (right) says he regularly winds up his co-star Tom Hiddleston about the possibility of being the next James Bond\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Hugh Laurie (right) says he regularly winds up his co-star Tom Hiddleston about the possibility of being the next James Bond</p></div><p class=\"mol-para-with-font\">A certain stress has lifted for both him and his wife, theatre administrator Jo Green, now their children, Charles, 28, William, 25, and Rebecca, 24, are all grown up and off his hands.</p><p class=\"mol-para-with-font\">‘I think that if a parent is lucky enough to keep their child out of hospital and out of prison up until they are in their mid to late 20s, then they’ve done their job, and I’m very proud to say that my wife and I have gone that far. We do miss them around the house, though.</p><p class=\"mol-para-with-font\">‘They have their own lives now, so unless we can lay on a good joint of beef for Sunday lunch, we might not see them for a while. They’re very, very funny and very good company, and I suppose I’m going to become one of those wistful parents who wishes the children would visit more, but that is the lot of the parent. Maybe my own parents felt the same about me, I don’t know.’</p><p class=\"mol-para-with-font\">His own father, William — an Olympic rowing champion — was a GP in Blackbird Leys, the council estate built to house Austin Morris workers at the Cowley plant at Oxford. Laurie is quick to point out, though, that his dad was more along the lines of the BBC’s fictitious TV medic from the Sixties, the benign Dr Finlay, than either of the doctors he portrays on the small screen.</p><div class=\"mol-img-group floatRHS\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-ed67881fde306e68\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/06FE7489000005DC-4586930-image-m-62_1496970933318.jpg\"\n         height=\"565\" width=\"306\" alt=\"Laurie as the star of the hit US show House\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-ed67881fde306e68\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/06FE7489000005DC-4586930-image-m-62_1496970933318.jpg\" height=\"565\" width=\"306\" alt=\"Laurie as the star of the hit US show House\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Laurie as the star of the hit US show House</p></div><p class=\"mol-para-with-font\">Laurie’s new character, Dr Eldon Chance, is a more sensitive fellow than the egotistical and sardonic Dr Gregory House, but is drawn into the complicated personal life of an attractive blonde patient, played by Gretchen Mol. With a history of money troubles, and battles with a difficult spouse he’s divorcing, Chance is forced to confront his own demons.</p><p class=\"mol-para-with-font\">Laurie says: ‘Apart from both men having a medical degree, the similarity ends there. I always felt House was a very guarded character — he has a big shield around him of sarcasm and wit, sometimes cruelty.</p><p class=\"mol-para-with-font\">‘Chance is much more naked and vulnerable — he’s protected by his professional skill, but that skill has not shielded him from the injuries and insults of this world.</p><p class=\"mol-para-with-font\">‘He’s not tough — he feels the pain of his patients very keenly. He’s a good man, a kind man.’</p><p class=\"mol-para-with-font\">Another difference, he says, is that while House dealt with diseases of the body, Chance focuses exclusively on those of the mind. And that’s a fascinating place, because if you think about it, the 3lb of stuff we have between our ears — that’s the last undiscovered continent.</p><p class=\"mol-para-with-font\">‘We’ve climbed all the mountains, we’ve gone down to the bottom of the Pacific Ocean, and in 20 years’ time we’ll have a Starbucks on Mars. But what is going on inside our brains is something we know almost nothing about, and that, in itself, is a fascinating premise.’</p><p class=\"mol-para-with-font\">Given all this, why was The Night Manager so important to Hugh? ‘I’d been trying for 20 years to get the original story by John le Carre made. It was such a huge success that we are still reeling from all the reaction.</p><p class=\"mol-para-with-font\">‘It was a complete thrill, but also sort of scary.</p><p class=\"mol-para-with-font\">‘When you have something you have really wished for and hoped for and dreamed for, and it at last actually becomes real, then you have the worry of — oh, what if I don’t do it right? What if I don’t do justice to this creation which has been in my head for so long?</p><p class=\"mol-para-with-font\">‘It’s that old thing that if someone tosses you a tennis ball you can catch it, but if someone tosses you a Faberge egg, then you have the anxiety about dropping it.</p><p class=\"mol-para-with-font\">‘I loved this book so much that, yes, to have the series made was a gift, but it was also a gift that I was so anxious not to mess up.</p><p class=\"mol-para-with-font\">‘I’d read all le Carre’s stories that had been set in the Cold War, of course, but by the time this book came out, the Cold War was officially over, and I was thinking “Well, now that the spies are out of work, maybe the spy novelists are out of work, too, because there are no more stories to be told.”</p><p class=\"mol-para-with-font\">‘But with The Night Manager, I was three chapters in, and I thought, “Oh, yeah! I don’t have to worry about this, because le Carre has found, if anything, a bigger contest between good and evil.” I was gripped. Still am.’</p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-5e5c96fffc1c4a99\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/04CB852D000003E8-4586930-image-a-66_1496971210201.jpg\"\n         height=\"423\" width=\"634\" alt=\"This time he¿s a neuropsychiatrist in a show called Chance, a thriller which has already gained him plaudits in America, and will be shown here later this month\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-5e5c96fffc1c4a99\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/04CB852D000003E8-4586930-image-a-66_1496971210201.jpg\" height=\"423\" width=\"634\" alt=\"This time he¿s a neuropsychiatrist in a show called Chance, a thriller which has already gained him plaudits in America, and will be shown here later this month\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">This time he’s a neuropsychiatrist in a show called Chance, a thriller which has already gained him plaudits in America, and will be shown here later this month</p></div><p class=\"mol-para-with-font\">Although he is not in the habit of taking screen options on novels, he says that he immediately snapped this one up. ‘I had never before this optioned anything in my life, I am not a natural producer. But I just fell in love with that world and the characters in it.</p><p class=\"mol-para-with-font\">‘Back then, of course, I dreamed of playing the role of the Night Manager himself, Jonathan Pine, which eventually went to Tom Hiddleston. But the world turns, and we all got older and my hair fell out …’</p><p class=\"mol-para-with-font\">Laurie smiles ruefully and passes a hand over his thinning locks. ‘But it’s just as well because Tom was absolutely magnificent in it, and I thought the character I did play, Richard Roper, was a magnificent creation, too, so it all worked out for the best.’</p><p class=\"mol-para-with-font\">He and Hiddleston have become close friends. ‘I tease him all the time,’ he says, his long, lugubrious face lighting up with pleasure as he thinks of his young co-star, who is still one of the favourites to be the next James Bond.</p><p class=\"mol-para-with-font\">‘We’ll have dinner together and I’ll pick on something about him … his socks, perhaps,’ he suggests happily. ‘I’ll say: “Aha! So you’re wearing socks! Bond wears socks, doesn’t he!” ’ He barks a triumphant snort of laughter.</p><p class=\"mol-para-with-font\">‘Well, obviously, I can’t let the Bond rumours go,’ he explains. ‘The poor chap has to suffer the absurdity of everything he says, everything he wears, every person he speaks to, contributing to some sort of nonsense — and most of it about James Bond — so of course he has to put up with me making fun of it, too.</p><div class=\"mol-img-group floatRHS\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-bd829bd9a28aa1c\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/1516B32C00000514-4586930-image-m-65_1496971075203.jpg\"\n         height=\"515\" width=\"306\" alt=\"Laurie won of Best Supporting Actor in a Series\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-bd829bd9a28aa1c\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/02/1516B32C00000514-4586930-image-m-65_1496971075203.jpg\" height=\"515\" width=\"306\" alt=\"Laurie won of Best Supporting Actor in a Series\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Laurie won of Best Supporting Actor in a Series</p></div><p class=\"mol-para-with-font\">‘But on the other hand, there are worse rumours for a young man to have to put up with.’</p><p class=\"mol-para-with-font\">Laurie’s own socks came into the spotlight last October when he — literally — cemented his place among showbusiness royalty with a star outside the Pig’n Whistle British pub on Hollywood’s Walk Of Fame. As a reminder of his roots, he wore Union Jack socks with his smart business suit, but it was no luvvie-fest.</p><p class=\"mol-para-with-font\">Stephen Fry paid tribute to him as ‘preposterously talented’, but then came the sting — ‘He’s repulsively handsome, slightly knock-kneed and his nipples are too far apart, but otherwise he’s almost perfect’.</p><p class=\"mol-para-with-font\">Fry himself could be forgiven for being envious of his friend’s success — after settling in LA last year with his husband Elliott Spencer, his U.S. sitcom The Great Indoors was cancelled after one series. Has Laurie offered him any advice about negotiating his way around the perilous world of Hollywood?</p><p class=\"mol-para-with-font\">‘I wouldn’t presume to do that, good Lord, no! Besides — I don’t know what advice I’d give anyway, because I don’t feel I’ve learned anything at all in my time here, I just bumble on from day to day.</p><p class=\"mol-para-with-font\">‘People sometimes seem to think that I have a very clever career plan that I’ve been following, but the fact is that I don’t have any plan at all, and never have had. In my own mind, I don’t even really think I have a career — that word sounds far too structured for what I do.</p><p class=\"mol-para-with-font\">‘If someone said to me now: “OK, that’s it, you’ve had your turn, now you have to go and be an accountant for 20 years,” I would be all right with that. I wouldn’t be much good at it, because I can’t add up. But I’d be quite happy about it.’</p><ul class=\"mol-bullets-with-font\"><li class=\"\">Hugh Laurie’s new series, Chance, starts on June 20 at 9pm on Universal Channel.</li></ul></div>\n            <!-- ad: http://mads.dailymail.co.uk/v4/vn/tvshowbiz/none/article/other/inread_player.html --><div class=\"adHolder\" id=\"inread_player\"><script>adverts.addToArray({\"pos\":\"inread_player\"})</script><span class=\"mol-ads-label-container\"><span class=\"mol-ads-label\">Advertisement</span></span></div>\n\n            \n            \n            \n            \n            <div class=\"column-content cleared\">\n                <div class=\"shareArticles\">\n                    <h3 class=\"social-links-title\">Share or comment on this article</h3>\n                    <div class=\"social-links cleared\" id=\"socialLinks\">\n                        <ul class=\"bigLinks sc-icns cleared\">\n                            <li class=\"share-facebook\">\n                                <a class=\"js-tl\" rel=\"nofollow\"></a>\n                            </li>\n                            <li class=\"share-twitter\">\n                                <a class=\"js-tl\" rel=\"nofollow\"></a>\n                            </li>\n                            <li class=\"share-pinterest\">\n                                <a class=\"js-tl\" rel=\"nofollow\"></a>\n                            </li>\n                            <li class=\"share-gplus\">\n                                <span class=\"g-interactivepost\"\n                                    data-contenturl=\"http://www.