\n            data-calltoactionlabel=\"VIEW\"\n            data-calltoactionurl=\"http://www.dailymail.co.uk/tvshowbiz/article-4586662/Curse-crummy-Mummy.html\">\n        <a></a>\n      </span>\n        </li>\n        <li class=\"share-email\">\n            <a rel=\"nofollow\" href=\"mailto:?subject=Read this: Curse of the crummy Mummy: Buried in cliches as old as the pyramids, Tom Cruise\'s monstrous remake is beyond redemption &amp;body=Curse%20of%20the%20crummy%20Mummy%3A%20Buried%20in%20cliches%20as%20old%20as%20the%20pyramids%2C%20Tom%20Cruise%27s%20monstrous%20remake%20is%20beyond%20redemption%C2%A0%0A%0AWe%20all%20like%20a%20few%20hieroglyphics%20with%20our%20hokum%2C%20but%20this%20is%20too%20much%2C%20an%20absolute%20barrage%20of%20digitally%20enhanced%20silliness%20that%20not%20even%20Tom%20Cruise%20and%20Russell%20Crowe%20can%20save.%0A%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-4586662%2FCurse-crummy-Mummy.html%3Fito%3Demail_share_article-top%0A%0A%0AMost%20Read%20Articles%3A%0A%0A%27I%20miss%20him%27%3A%20Declan%20Donnelly%20admits%20Saturday%20Night%20Takeaway%20has%20been%20%27tinged%20with%20sadness%27%20without%20Ant%20McPartlin%E2%80%A6%20as%20fans%20are%20left%20in%20TEARS%20with%20finale%20performance%20as%20absent%20friend%20battles%20divorce%20and%20police%20charge%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589717%2FSaturday-Night-Takeaway-finale-Declan-Donnelly-leaves-fans-tears.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0ANoel%20Fielding%27s%20baby%20PICTURE%20EXCLUSIVE%3A%20Bake%20Off%20host%20steps%20out%20with%20newborn%20for%20the%20FIRST%20TIME%20since%20girlfriend%20Lliana%20Bird%20gives%20birth%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5589213%2FNoel-Fielding-steps-newborn-TIME-girlfriend-Lliana-Bird-gives-birth.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0AVictoria%20Beckham%27s%20daughter%20Harper%2C%20six%2C%20follows%20in%20her%20mother%27s%20chic%20footsteps%20as%20she%20totes%C2%A0stylish%20handbag%20during%20family%20dinner%20in%20LA%0Ahttp%3A%2F%2Fwww.dailymail.co.uk%2Ftvshowbiz%2Farticle-5588685%2FVictoria-Beckhams-daughter-Harper-6-follows-mothers-chic-footsteps-dinner-LA.html%3Fito%3Demail_share_article-top_most-read-articles%0A%0A\">\n                <span class=\"wai\">e-mail</span>\n            </a>\n        </li>\n        <li class=\"share-icons\" id=\"shareLinkTop\">\n            <a class=\"js-sl share-link email_share_article-top\"\n               href=\"#socialLinks\"></a>\n            <script type=\"text/javascript\">\n          var twitterVia = \'DailyMailCeleb\';\n          DM.later(\'bundle\', function(){\n            DM.has(\'shareLinkTop\', \'shareLinks\', {\n                    \'id\': \'4586662\',\n                    \'title\': \'Curse of the crummy Mummy\',\n                    \'url\': \'http://www.dailymail.co.uk/tvshowbiz/article-4586662/Curse-crummy-Mummy.html\',\n                    \'eTwitterStatus\': \' http://dailym.ai/2sZFLp4 via @\' + twitterVia,\n                    \'articleChannelFollowButton\': \'DailyMailCeleb\',\n                    \'isChannel\': false,\n                    \'hideEmail\': true,\n                    \'placement\': \'top\',\n                    \'anchor\': \'tl\'});\n          });\n\n\n            </script>\n        </li>\n    </ul>\n    <div class=\"share-count\">\n        <b>400</b>\n        <span>shares</span>\n    </div>\n    <a class=\"comments-count home\" target=\"_blank\" href=\"http://www.dailymail.co.uk/tvshowbiz/article-4586662/Curse-crummy-Mummy.html#comments\"> <span></span>\n        <p class=\"count-number\">         123</p>\n        <p class=\"count-text\">View <br> comments</p>\n    </a>\n    <script>\n        DM.later(\'bundle\', function(){\n            DMS.Article.init(\'top\');\n        });\n\n\n    </script>\n</div>\n</p><div itemprop=\"articleBody\"><p class=\"mol-para-with-font\"><span class=\"mol-style-bold\">The Mummy (15)</span></p><p class=\"mol-ratings\"><strong>Rating: <strong><img class=\"rating\" src=\"http://i.dailymail.co.uk/i/articles/ratingStars/rating_showbiz_2.gif\" width=\"55\" /></strong></strong></p><p class=\"mol-para-with-font\"><span class=\"\"><span class=\"mol-style-italic\">Verdict: Cruise control is not enough </span></span></p><p class=\"mol-para-with-font\"><span class=\"mol-style-bold\">My Cousin Rachel (12A) </span></p><p class=\"mol-ratings\"><strong>Rating: <strong><img class=\"rating\" src=\"http://i.dailymail.co.uk/i/articles/ratingStars/rating_showbiz_3.gif\" width=\"55\" /></strong></strong></p><p class=\"mol-para-with-font\"><span class=\"\"><span class=\"mol-style-italic\">Verdict: Handsome Victorian melodrama </span></span></p><p class=\"mol-para-with-font\">Hard on the heels of Wonder Woman comes The Mummy, about a vengeful Ancient Egyptian princess who is woken from the dead 5,000 years after being mummified alive.</p><p class=\"mol-para-with-font\">That makes it an all-female battle for supremacy at the box office, which The Mummy deserves to lose, bandaged hands down. We all like a few hieroglyphics with our hokum, but this is too much, an absolute barrage of digitally enhanced silliness that not even Tom Cruise and Russell Crowe can save.</p><p class=\"mol-para-with-font\">However, there are some undeniably slick action scenes, some great stunts and, for amateur Egyptologists, all the cliches you hold most dear: sarcophagi, scarab rings, sphinxes, amulets, pyramids, the lot. I really can’t say pharoah than that. </p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-daf98ac34b8a0318\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F15E800000578-4586662-image-m-3_1496965152065.jpg\"\n         height=\"418\" width=\"634\" alt=\"Come To Mummy: Sofia Boutella as Princess Ahmanet. We all like a few hieroglyphics with our hokum, but this is too much, an absolute barrage of digitally enhanced silliness\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-daf98ac34b8a0318\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F15E800000578-4586662-image-m-3_1496965152065.jpg\" height=\"418\" width=\"634\" alt=\"Come To Mummy: Sofia Boutella as Princess Ahmanet. We all like a few hieroglyphics with our hokum, but this is too much, an absolute barrage of digitally enhanced silliness\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Come To Mummy: Sofia Boutella as Princess Ahmanet. We all like a few hieroglyphics with our hokum, but this is too much, an absolute barrage of digitally enhanced silliness</p></div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-7b66b505c67bf435\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F0BEE00000578-4586662-image-a-1_1496965118614.jpg\"\n         height=\"423\" width=\"634\" alt=\"Tom Cruise stars next to a sexy archaeologist (in the movies there are rarely any other kind) called Jenny Halsey (Annabelle Wallis)\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-7b66b505c67bf435\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F0BEE00000578-4586662-image-a-1_1496965118614.jpg\" height=\"423\" width=\"634\" alt=\"Tom Cruise stars next to a sexy archaeologist (in the movies there are rarely any other kind) called Jenny Halsey (Annabelle Wallis)\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Tom Cruise stars next to a sexy archaeologist (in the movies there are rarely any other kind) called Jenny Halsey (Annabelle Wallis)</p></div><p class=\"mol-para-with-font\">Cruise plays Nick Morton, a soldier with a U.S. reconnaissance unit in modern-day Iraq, who exploits his position to steal ancient artefacts and sell them on the black market.</p><p class=\"mol-para-with-font\">Following a bombing mission against insurgents, the desert dust gives way to reveal the burial chamber of Princess Ahmanet (Sofia Boutella), which, in one of several nods to the Indiana Jones movies, is guarded by thousands of scuttling spiders.</p><p class=\"mol-para-with-font\">It is also of great interest to a sexy archaeologist (in the movies there are rarely any other kind) called Jenny Halsey (Annabelle Wallis). She is wise to Nick’s shady activities because they have recently had a one-night-stand in Baghdad, during which he sneakily raided her belongings.</p><p class=\"mol-para-with-font\">But she is soon in his debt. Shortly before their transporter plane crashes — over Surrey of all places, and with Ahmanet’s sarcophagus on board — Nick saves her life by hooking her up to the aircraft’s only parachute and pushing her out.</p><div class=\"mol-img-group floatRHS\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-b291c2686a953648\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F0C9600000578-4586662-image-a-5_1496965167863.jpg\"\n         height=\"434\" width=\"306\" alt=\"Cruise’s character is meant to be innately malignant, but you can almost hear him and the producers agreeing that he must have a whole sarcophagus-full of redeeming qualities\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-b291c2686a953648\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F0C9600000578-4586662-image-a-5_1496965167863.jpg\" height=\"434\" width=\"306\" alt=\"Cruise’s character is meant to be innately malignant, but you can almost hear him and the producers agreeing that he must have a whole sarcophagus-full of redeeming qualities\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Cruise’s character is meant to be innately malignant, but you can almost hear him and the producers agreeing that he must have a whole sarcophagus-full of redeeming qualities</p></div><p class=\"mol-para-with-font\">That he miraculously survives the crash himself turns out to be the work of the resurrected Ahmanet, with whom he has a mysterious ancient connection conveyed in lots of meaningful flashbacks.</p><p class=\"mol-para-with-font\">Yet there is no mystery in this film greater than that of Jenny’s pink lip gloss, which through the hairiest tribulations imaginable, including the plane incident, a high-speed ambulance crash, and near-fatal immersion in a flooded London Underground tunnel, remains utterly immaculate.</p><p class=\"mol-para-with-font\">A two-hour Revlon commercial could not champion the wonders of lip gloss any more spiritedly than The Mummy.</p><p class=\"mol-para-with-font\">The action moves to London, in case you were wondering, because in 1127 AD, a knight crusader was buried with the ruby stolen from the handle of the iconic Dagger of Set, the Egyptian God of Death.</p><p class=\"mol-para-with-font\">Ahmanet wants it back, and to that end she has enlisted a small army of the living dead, including Nick’s old army accomplice, Vail (Jake Johnson).</p><p class=\"mol-para-with-font\">By now everything is getting terribly overwrought, and I can’t have been the only one in the cinema to have shifted uncomfortably in my seat during a scene in which terror is visited upon the streets of our capital, with thousands fleeing for their lives.</p><p class=\"mol-para-with-font\">Could, should, the release of The Mummy not have been postponed in the wake of the London Bridge attack?</p><p class=\"mol-para-with-font\">Still, it’s not as though any of this seems remotely real. And new levels of preposterousness are reached with the help of Dr Henry Jekyll (Crowe), who leads a shadowy organisation devoted to finding and exterminating monsters. The irony is that Dr Jekyll himself has a monstrous alter ego, by the name of . . . Mr Hyde.</p><p class=\"mol-para-with-font\">I have no idea why Robert Louis Stevenson’s classic story of split personality should be absorbed into The Mummy. Perhaps director Alex Kurtzman and his writers wanted to anchor the film’s soaring daftness with something vaguely familiar.</p><div class=\"moduleFull mol-video\"><a name=\"video\" class=\"namedLink\"></a><div class=\"item\">\n  <div class=\"vjs-video-container vjs-fixed vjs-span-two-col tvshowbiz\" id=\"v-3797565549064767146\">\n  <video controls class=\"video-js vjs-default-skin\" \n         data-opts=\'{\"linkBaseURL\":\"http://www.dailymail.co.uk/tvshowbiz/article-4586662/Curse-crummy-Mummy.html#v-3797565549064767146\",\"isMobile\":false,\"duration\":117000,\"src\":\"http://video.dailymail.co.uk/video/mol/2017/05/18/3797565549064767146/1024x576_MP4_3797565549064767146.mp4\",\"source\":\"YouTube\",\"playerId\":\"default\",\"title\":\"Tom Cruise and Sofia Boutella in trailer for The Mummy\",\"preload\":\"none\",\"initialVideo\":true,\"thumbnail\":\"http://i.dailymail.co.uk/i/pix/2017/05/18/20/4081DF5600000578-0-image-m-3_1495136514253.jpg\",\"poster\":\"http://i.dailymail.co.uk/i/pix/2017/05/18/20/4081DF5600000578-0-image-a-1_1495136510107.jpg\",\"syndicationService\":null,\"plugins\":{\"social-share\":{\"embedUrl\":\"http://www.dailymail.co.uk/embed/video/1473171.html\"},\"autoplay-next-video\":{\"videos\":\"http://www.dailymail.co.uk/api/player/1473171/related-videos.json\",\"countdown_time\":10},\"ads-setup\":{\"videoAdServerUrl\":\"http://pubads.g.doubleclick.net/gampad/ads?sz=[size]&iu=%2F5765%2Fdm.video%2Fdm_video_tvshowbiz&ciu_szs=&impl=s&gdfp_req=1&env=vp&output=xml_vast3&unviewed_position_start=1&url=[referrer_url]&correlator=[timestamp]\",\"adsEnabled\":true,\"adsCancelTimeout\":15000,\"screen\":{\"width\":636,\"height\":358}},\"sources\":{\"url\":\"http://www.dailymail.co.uk/api/player/3797565549064767146/video-sources.json\"},\"flyout\":{\"viewportOffset\":0.4,\"switchBack\":true,\"forceFlyout\":{\"active\":false,\"muted\":true,\"switchBack\":false}},\"tracking\":{\"channelShortName\":\"tvshowbiz\",\"sponsored\":null,\"referenceId\":1473171,\"trackingType\":\"embedded\"},\"autoplay-inline\":{\"enabled\":false},\"animated-preview\":{\"data-hd-fps\":7,\"data-hd-frame-count\":56,\"frames\":120,\"width\":636,\"src\":\"http://video.dailymail.co.uk/preview/mol/2017/05/18/5255374530828352983/636x382_JPG-SINGLE_5255374530828352983.jpg\",\"fps\":0,\"data-film\":\"http://video.dailymail.co.uk/preview/mol/2017/05/18/5255374530828352983/308x174_JPG_5255374530828352983.jpg\",\"data-fps\":7,\"data-video\":\"http://video.dailymail.co.uk/preview/mol/2017/05/18/5255374530828352983/636x382_MP4_5255374530828352983.mp4\",\"data-hd-film\":\"http://video.dailymail.co.uk/preview/mol/2017/05/18/5255374530828352983/636x382_JPG-HD_5255374530828352983.jpg\",\"data-hd-frame-width\":636,\"data-frame-height\":230,\"data-frame-width\":308,\"data-frame-count\":56,\"height\":476,\"data-hd-frame-height\":476},\"related-videos\":{\"videos\":\"http://www.dailymail.co.uk/api/player/1473171/related-videos.json\"}},\"videoId\":\"3797565549064767146\",\"descr\":\"The Mummy Third Trailer, featuring Tom Cruise unleashing Sofia Boutella&#39;s Mummy.\",\"referenceId\":1473171,\"grapeshot\":{\"article\":{\"articleURL\":\"http://www.dailymail.co.uk/news/article-5457527/Mel-Gibson-Tom-Cruise-Emoji-Movie-lead-Razzie-awards.html\"}}}\' preload=\"none\">\n    <source src=\"http://video.dailymail.co.uk/video/mol/2017/05/18/3797565549064767146/1024x576_MP4_3797565549064767146.mp4\" type=\'video/mp4\'/>\n  </video>\n</div>\n\n</div>\n</div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-47f11afbc1f1fc3f\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/413DC33200000578-4586662-image-a-6_1496965180097.jpg\"\n         height=\"287\" width=\"634\" alt=\"There are also a few modest frights and Cruise fans can look forward to heaps of derring-do, not to mention a fleeting glimpse of him in the buff\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-47f11afbc1f1fc3f\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/413DC33200000578-4586662-image-a-6_1496965180097.jpg\" height=\"287\" width=\"634\" alt=\"There are also a few modest frights and Cruise fans can look forward to heaps of derring-do, not to mention a fleeting glimpse of him in the buff\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">There are also a few modest frights and Cruise fans can look forward to heaps of derring-do, not to mention a fleeting glimpse of him in the buff</p></div><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-8a5d6dae8bb0161d\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F179000000578-4586662-image-a-7_1496965194857.jpg\"\n         height=\"266\" width=\"634\" alt=\"Not even the A-list names of Tom Cruise and Russell Crowe can save The Mummy from being a let down\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-8a5d6dae8bb0161d\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F179000000578-4586662-image-a-7_1496965194857.jpg\" height=\"266\" width=\"634\" alt=\"Not even the A-list names of Tom Cruise and Russell Crowe can save The Mummy from being a let down\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\">Not even the A-list names of Tom Cruise and Russell Crowe can save The Mummy from being a let down</p></div><p class=\"mol-para-with-font\">If so, it doesn’t work. It just makes it dafter still.</p><p class=\"mol-para-with-font\">All that said, there is an energy to The Mummy that might appeal to some cinema-goers. There are also a few modest frights and Cruise fans can look forward to heaps of derring-do, not to mention a fleeting glimpse of him in the buff.</p><p class=\"mol-para-with-font\">Mind you, I watched the film in full IMAX 3D, which frankly is no way to see anyone unclothed, and also makes you want to shield your eyes from the megawatt Cruise smile.</p><p class=\"mol-para-with-font\">In this film, as in 2014’s superior Edge Of Tomorrow, Cruise’s character is meant to be innately malignant, but you can almost hear him and the producers agreeing that he must have a whole sarcophagus-full of redeeming qualities, for the simple reason that he’s Tom Cruise.</p><p class=\"mol-para-with-font\">It’s not one of his better endeavours, frankly. Towards the end, as Nick tries to make things right between him and the lovely Jenny, he says: ‘I have made so many mistakes, but not this time.’ I’m not at all sure about that.</p><div class=\"mol-page-break\"><div class=\"pageBreak\"> </div><div class=\"clear\"> </div></div><p class=\"mol-para-with-font\">If the Mummy has several cinematic antecedents, going right back to the 1932 Boris Karloff version of which it is very notionally a remake, My Cousin Rachel has just one.</p><p class=\"mol-para-with-font\">There was a 1952 version of Daphne du Maurier’s novel about obsessive Victorian love on the Cornish clifftops, starring Olivia de Havilland and Richard Burton. So it is more than ripe for another interpretation.</p><p class=\"mol-para-with-font\">The writer-director this time is Roger Michell, best known for Notting Hill (1999), with Rachel Weisz as the title character and Sam Claflin playing Philip Ashley, the younger man in her thrall.</p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-8292cb91c3f5ecb7\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411EF4D000000578-4586662-image-a-8_1496965198559.jpg\"\n         height=\"422\" width=\"634\" alt=\"\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-8292cb91c3f5ecb7\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411EF4D000000578-4586662-image-a-8_1496965198559.jpg\" height=\"422\" width=\"634\" alt=\"\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\"></p></div><p class=\"mol-para-with-font\">Philip first learns that his older cousin Ambrose, from whom he stands to inherit a fortune, has married an Englishwoman called Rachel while convalescing in Italy. When Ambrose’s letters home suggest he needs protection from Rachel, his ‘torment’, Philip rushes to the rescue. But by the time he arrives, Ambrose is dead.</p><p class=\"mol-para-with-font\">Philip is distraught and angry, but on meeting the beautiful Rachel falls immediately under her spell, and back in Cornwall starts lavishing his inheritance on her. Yet he, too, is inexplicably falling ill. Does the black widow have a fatal bite?</p><p class=\"mol-para-with-font\">Michell’s screenplay ensures we assume the worst of her, as do Philip’s guardian (Iain Glen), his daughter (Holliday Grainger) and, in a disappointingly minor role as the family lawyer, the mighty Simon Russell Beale.</p><p class=\"mol-para-with-font\">On the other hand, the spoilt, infatuated Philip is hardly deserving of our sympathies either. When he and Rachel have sex on a carpet of bluebells (not something Burton and de Havilland ever did), it is meant to look uncomfortably like rape. Which poses another question: which of this attractive pair is really the predator?</p><div class=\"artSplitter mol-img-group\">    <div class=\"mol-img\">  <div class=\"image-wrap\">\n    <img id=\"i-1618954ab905d221\"\n         src=\"data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7\" data-src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411EF7C500000578-4586662-image-a-9_1496965203863.jpg\"\n         height=\"422\" width=\"634\" alt=\"\" class=\"blkBorder img-share\"/>\n  </div>\n\n  <noscript>\n\n    <img id=\"i-1618954ab905d221\" src=\"http://i.dailymail.co.uk/i/pix/2017/06/09/00/411EF7C500000578-4586662-image-a-9_1496965203863.jpg\" height=\"422\" width=\"634\" alt=\"\" class=\"blkBorder img-share\"/>\n\n  </noscript>\n</div>    <p class=\"imageCaption\"></p></div><p class=\"mol-para-with-font\">It’s all marvellously acted and gorgeous to look at. Cinematographer Mike Eley practically makes an extra character of the light: lustrous sunlight, luminous moonlight, flickering candlelight, dancing firelight.</p><p class=\"mol-para-with-font\">But with a certain Cornwall-set drama back on our TV screens this weekend, I wonder whether, with its single-strand narrative and only limited shots of dishy heartthrobs galloping urgently along clifftops, My Cousin Rachel might also seem a bit like Poldark-lite?</p><p class=\"mol-para-with-font\"> </p></div>\n            <!-- ad: http://mads.dailymail.co.uk/v4/vn/tvshowbiz/none/article/other/inread_player.html --><div class=\"adHolder\" id=\"inread_player\"><script>adverts.addToArray({\"pos\":\"inread_player\"})</script><span class=\"mol-ads-label-container\"><span class=\"mol-ads-label\">Advertisement</span></span></div>\n\n            \n            \n            \n            \n            <div class=\"column-content cleared\">\n                <div class=\"shareArticles\">\n                    <h3 class=\"social-links-title\">Share or comment on this article</h3>\n                    <div class=\"social-links cleared\" id=\"socialLinks\">\n                        <ul class=\"bigLinks sc-icns cleared\">\n                            <li class=\"share-facebook\">\n                                <a class=\"js-tl\" rel=\"nofollow\"></a>\n                